(34, 65, 76, 'Reading 2', 9, 'https://canvas-lms.ga/courses/6/assignments/65', 6, '<p><span style=\"text-decoration: underline;\">(1) ## Add information for reading assignment:</span></p>\n<ul>\n<li>\n</li>\n</ul>\n<p> </p>\n<p><span style=\"text-decoration: underline;\">(2) ## Add information for reading assignment:</span></p>\n<p> </p>\n<p><span style=\"text-decoration: underline; font-size: 18pt;\"><strong>Then please answer the following questions about the reading - <span style=\"color: #800000; text-decoration: underline;\" data-darkreader-inline-color=\"\"><em>please submit as a PDF</em></span>.</strong></span></p>\n<p>(1) First Reading - (5 points each)</p>\n<ol>\n<li> ##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li> </li>\n</ol>\n<p><span style=\"font-size: 12pt;\">(2) Second Reading -  (5 points each)</span></p>\n<ol>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>\n</li>\n</ol>\n<ul>\n</ul>', NULL, '2020-10-13 09:10:41', '2020-10-13 09:10:41', NULL, 'https://canvas-lms.ga/courses/6/assignments/65/submissions?zip=1', NULL, NULL),
(35, 38, 76, 'Discussion WK 2 - Climate Corp case study', 9, 'https://canvas-lms.ga/courses/6/assignments/38', 6, '<p>Please watch the following link for the discussion prompts this week:</p>\n<p><a href=\"https://wsu.hosted.panopto.com/Panopto/Pages/Viewer.aspx?id=163355a4-7d1b-4368-ab38-abc7012fc0a0\">https://wsu.hosted.panopto.com/Panopto/Pages/Viewer.aspx?id=163355a4-7d1b-4368-ab38-abc7012fc0a0</a></p>\n<p> </p>\n<p>Please explain why you feel that Climate Corp has struggled to get more people interested in their product. (10 points)</p>\n<p>Please also include a recap of the information that is in the presentation to help justify your response.  (10 points)</p>\n<p> </p>\n<p>* You may upload a video for your discussion post, or a written work, whichever you prefer. </p>', NULL, '2020-10-13 09:10:37', '2020-10-13 09:10:37', NULL, 'https://canvas-lms.ga/courses/6/assignments/38/submissions?zip=1', NULL, NULL),
