(47, 434, 76, 'Week 1 LL: Preparing For Your Journey', 34, 'https://canvas-lms.ga/courses/9/assignments/434', 9, '<p><span>Create a Learning Log entry explaining what you have learned about compositions of functions. Use examples to illustrate your ideas. </span></p>\n<p><em>Title this entry “Composition of Functions” and include today’s date.</em></p>\n<ul></ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:09', '2020-10-13 09:25:16', NULL, 'https://canvas-lms.ga/courses/9/assignments/434/submissions?zip=1', NULL, NULL),
(48, 437, 76, 'Week 2 LL: Piecewise-Defined Functions, Continuity, and Radian Measure', 34, 'https://canvas-lms.ga/courses/9/assignments/437', 9, '<p><span>Write a Learning Log entry that demonstrates what you have learned about inverse functions. </span></p>\n<p><span>If you have a function and its inverse, how can you be sure that both equations represent functions? How can you verify that the functions are inverses of each other? </span></p>\n<p><span>Include an example by selecting a function and its inverse and then justifying that the functions are inverses of each other. Use multiple representations and function composition. </span></p>\n<p><span>Do you have to restrict the domains of your functions? Explain why or why not. </span></p>\n<p><span><em>Title this entry “Inverse Functions” and include today’s date</em>.</span></p>\n<ul></ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:09', '2020-10-13 09:25:09', NULL, 'https://canvas-lms.ga/courses/9/assignments/437/submissions?zip=1', NULL, NULL),
(49, 441, 76, 'Week 3 LL: Unit 1 Review', 34, 'https://canvas-lms.ga/courses/9/assignments/441', 9, '<p>Create a study guide with tips, instructions, diagrams, and examples in preparation for the unit 1 exam. Some of the topics you might like to include are:</p>\n<ul>\n<li><span style=\"font-size: 1rem;\">Composition of Functions</span></li>\n<li>Inverse Functions</li>\n<li>\n<span style=\"font-size: 1rem;\">Radians                                                                                                                                                           </span><span style=\"font-size: 1rem;\">The study guide should be thorough and clear enough that a classmate could use it. Use headings and subheadings as well as \"multiple representations\" to make your study guide more clear.</span>\n</li>\n</ul>\n<ul></ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:10', '2020-10-13 09:25:10', NULL, 'https://canvas-lms.ga/courses/9/assignments/441/submissions?zip=1', NULL, NULL),
(50, 442, 76, 'Week 4 LL: Trigonometric Ratios in the Unit Circle', 34, 'https://canvas-lms.ga/courses/9/assignments/442', 9, '<p><span data-sheets-value=\'{\"1\":2,\"2\":\"Write a Learning Log entry explaining how a logarithm works. Describe the relationship between a logarithmic expression and its equivalent exponential expression. Include examples. Then evaluate the following expressions: logb(b), logb(ba), logb(1), , log(10), ln(e). Title this entry “Logarithms” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>Write a Learning Log entry listing the different characteristics you have learned to describe functions. Include definitions and example sketches. </span></p>\n<p><span data-sheets-value=\'{\"1\":2,\"2\":\"Write a Learning Log entry explaining how a logarithm works. Describe the relationship between a logarithmic expression and its equivalent exponential expression. Include examples. Then evaluate the following expressions: logb(b), logb(ba), logb(1), , log(10), ln(e). Title this entry “Logarithms” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>Title this entry “Describing Functions” and include today’s date.</span><span data-sheets-value=\'{\"1\":2,\"2\":\"Write a Learning Log entry explaining how a logarithm works. Describe the relationship between a logarithmic expression and its equivalent exponential expression. Include examples. Then evaluate the following expressions: logb(b), logb(ba), logb(1), , log(10), ln(e). Title this entry “Logarithms” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'></span></p>\n<ul></ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:10', '2020-10-13 09:25:10', NULL, 'https://canvas-lms.ga/courses/9/assignments/442/submissions?zip=1', NULL, NULL),
(51, 445, 76, 'Week 5 LL: Graphing Logarithms', 34, 'https://canvas-lms.ga/courses/9/assignments/445', 9, '<p><span data-sheets-value=\'{\"1\":2,\"2\":\"Write a Learning Log entry about the family of functions y = logb(x). Think about how the family of logarithmic functions relates to the family of exponential functions. Describe how to graph a logarithmic function. Title this entry “The Family of Logarithmic Functions” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>Write a Learning Log entry about the family of functions <img class=\"equation_image\" title=\"\\log_b\\left(x\\right)\" src=\"https://canvas.instructure.com/equation_images/%255Clog_b%255Cleft(x%255Cright)\" alt=\"LaTeX: \\log_b\\left(x\\right)\" data-equation-content=\"\\log_b\\left(x\\right)\" data-mathml=\'&lt;math xmlns=\"http://www.w3.org/1998/Math/MathML\"&gt;\n  &lt;msub&gt;\n    &lt;mi&gt;log&lt;/mi&gt;\n    &lt;mi&gt;b&lt;/mi&gt;\n  &lt;/msub&gt;\n  &lt;mo&gt;&amp;#x2061;&lt;!-- ? --&gt;&lt;/mo&gt;\n  &lt;mrow&gt;\n    &lt;mo&gt;(&lt;/mo&gt;\n    &lt;mi&gt;x&lt;/mi&gt;\n    &lt;mo&gt;)&lt;/mo&gt;\n  &lt;/mrow&gt;\n&lt;/math&gt;\' x-canvaslms-safe-mathml=\'&lt;math xmlns=\"http://www.w3.org/1998/Math/MathML\" display=\"inline\"&gt;&lt;msub&gt;&lt;mi&gt;log&lt;/mi&gt;&lt;mi&gt;b&lt;/mi&gt;&lt;/msub&gt;&lt;mrow&gt;&lt;mo&gt;(&lt;/mo&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mo&gt;)&lt;/mo&gt;&lt;/mrow&gt;&lt;/math&gt;\'>. Think about how the family of logarithmic functions relates to the family of exponential functions. </span></p>\n<p><span data-sheets-value=\'{\"1\":2,\"2\":\"Write a Learning Log entry about the family of functions y = logb(x). Think about how the family of logarithmic functions relates to the family of exponential functions. Describe how to graph a logarithmic function. Title this entry “The Family of Logarithmic Functions” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>Describe how to graph a logarithmic function. Be sure to talk about the difference between:</span></p>\n<ul>\n<li><span data-sheets-value=\'{\"1\":2,\"2\":\"Write a Learning Log entry about the family of functions y = logb(x). Think about how the family of logarithmic functions relates to the family of exponential functions. Describe how to graph a logarithmic function. Title this entry “The Family of Logarithmic Functions” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>The parameter <em>b</em></span></li>\n<li>The variable <em>x</em>\n</li>\n</ul>\n<p><em>Title this entry “The Family of Logarithmic Functions” and include today’s date.</em></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:11', '2020-10-13 09:25:11', NULL, 'https://canvas-lms.ga/courses/9/assignments/445/submissions?zip=1', NULL, NULL),
(52, 448, 76, 'Week 6 LL: Unit 5 Exam Review', 34, 'https://canvas-lms.ga/courses/9/assignments/448', 9, '<p>Create a study guide with tips, instructions, diagrams, and examples in preparation for the unit 5 exam. Some of the topics you might like to include are:</p>\n<ul>\n<li>Graphing Trig Functions</li>\n<li>Graphing Logarithmic and Exponential Functions (basic transformations only)</li>\n<li>Solving Logarithmic and Exponential Equations</li>\n<li>Solving Polynomial Inequalities</li>\n<li>Graphing Reciprocal Functions</li>\n</ul>\n<p>The study guide should be thorough and clear enough that a classmate could use it. Use heading and subheading as well as \"multiple representations\" to make your study guide more clear.</p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:11', '2020-10-13 09:25:12', NULL, 'https://canvas-lms.ga/courses/9/assignments/448/submissions?zip=1', NULL, NULL);
