(53, 450, 76, 'Week 7 LL: Solving Triangles', 34, 'https://canvas-lms.ga/courses/9/assignments/450', 9, '<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, describe what it means to solve a triangle completely. Include a list of the strategies that can be used when solving triangles and when to use them. Be sure to include examples. Title this Learning Log entry “Solving Triangles” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>In your Learning Log, describe what it means to solve a triangle completely. Include a list of the strategies that can be used when solving triangles and when to use them. </span></p>\n<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, describe what it means to solve a triangle completely. Include a list of the strategies that can be used when solving triangles and when to use them. Be sure to include examples. Title this Learning Log entry “Solving Triangles” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>Be sure to include examples. </span></p>\n<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, describe what it means to solve a triangle completely. Include a list of the strategies that can be used when solving triangles and when to use them. Be sure to include examples. Title this Learning Log entry “Solving Triangles” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>Title this Learning Log entry “Solving Triangles” and include today’s date.</span></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:12', '2020-10-13 09:25:12', NULL, 'https://canvas-lms.ga/courses/9/assignments/450/submissions?zip=1', NULL, NULL),
(54, 453, 76, 'Week 8 LL: Vectors', 34, 'https://canvas-lms.ga/courses/9/assignments/453', 9, '<p>In your Learning Log, sketch examples and show the computations for obtaining the component form of each of the following vector operations.</p>\n<p><img src=\"https://canvas-lms.ga/courses/9/files/400/preview?verifier=JRiKqIBskgpTBLkqL1zixEYP88X7K8nAe5StOwPx\" alt=\"Screen Shot 2019-01-04 at 11.03.45 AM.png\" width=\"521\" height=\"35\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/9/files/400\" data-api-returntype=\"File\"></p>\n<p>Then include the terms and examples of:</p>\n<ul>\n<li>scalar,</li>\n<li>opposite vector,</li>\n<li>and zero vector.</li>\n</ul>\n<p><em>Title this entry “Operations with Vectors” and include today’s date.</em></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:12', '2020-10-13 09:25:12', NULL, 'https://canvas-lms.ga/courses/9/assignments/453/submissions?zip=1', NULL, NULL),
(55, 456, 76, 'Week 9 LL: Trig Graphs', 34, 'https://canvas-lms.ga/courses/9/assignments/456', 9, '<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, write the general equations for transformations of y = sin(x) and y = cos(x) that include all four transformations. Include example graphs. Title this entry “Transformations of Sine and Cosine” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":257,\"3\":{\"1\":0},\"11\":4}\'>In your Learning Log, write the general equations for transformations of y = sin(x) and y = cos(x) that include all four transformations. <strong>Include example graphs. </strong></span></p>\n<p><em>Title this entry “Transformations of Sine and Cosine” and include today’s date.</em></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:13', '2020-10-13 09:25:13', NULL, 'https://canvas-lms.ga/courses/9/assignments/456/submissions?zip=1', NULL, NULL),
(56, 423, 76, 'Week 10 LL: Reciprocal Trig Functions', 34, 'https://canvas-lms.ga/courses/9/assignments/423', 9, '<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, explain everything you know about the reciprocal trigonometric functions. Use multiple representations to illustrate your understanding. Title this entry “Reciprocal Trigonometric Functions” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":769,\"3\":{\"1\":0},\"11\":4,\"12\":0}\'>In your Learning Log, explain everything you know about the reciprocal trigonometric functions. Use multiple representations to illustrate your understanding. </span></p>\n<p><em>Title this entry “Reciprocal Trigonometric Functions” and include today’s date.</em></p>\n<p><strong><em>Multiple Representations Diagram</em></strong></p>\n<p><strong><em><img src=\"https://canvas-lms.ga/courses/9/files/399/preview?verifier=EwIUxItWTuqGXVkr7qnW6TkOr6YmxLptM9qGqM3Z\" alt=\"Multiple Representations\" width=\"203\" height=\"135\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/9/files/399\" data-api-returntype=\"File\"></em></strong></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:07', '2020-10-13 09:25:07', NULL, 'https://canvas-lms.ga/courses/9/assignments/423/submissions?zip=1', NULL, NULL),
