(95, 470, 76, 'Energy and Enzymes: Self Guided', 37, 'https://canvas-lms.ga/courses/10/assignments/470', 10, '<p>Read the following chapters and complete the questions at the end of the chapter:</p>\n<p>Chapter 4 Cellular Respiration</p>\n<p>Chapter 5 Photosynthesis</p>\n<p>Chapter 2 pages 22-24 (complete questions 1-3 and 5)</p>\n<p>then read pages 282-284, 298-299 and answer questions pg 301 #4,-6, pg. 302 8 and 9</p>\n<p>Once completed and uploaded to canvas, you can take the energy quiz. you must score an 85% in order to move on.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:32:20', '2020-10-13 09:32:20', NULL, 'https://canvas-lms.ga/courses/10/assignments/470/submissions?zip=1', NULL, NULL),
(96, 480, 76, 'HW Free Response', 37, 'https://canvas-lms.ga/courses/10/assignments/480', 10, '<p><img src=\"https://canvas-lms.ga/courses/10/files/494/preview?verifier=T5PHiMYBnkrNx9VL1DSHiXRIVxsrnQOIaUjVcQTz\" alt=\"Screenshot 2017-03-20 11.05.27.png\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/494\" data-api-returntype=\"File\"></p>\n<p>Answer on a separate sheet of paper and upload a doc scan (pdf only) of your answer. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:32:21', '2020-10-13 09:32:21', NULL, 'https://canvas-lms.ga/courses/10/assignments/480/submissions?zip=1', NULL, NULL),
