(98, 459, 76, 'Genetic variation', 39, 'https://canvas-lms.ga/courses/10/assignments/459', 10, '<p>You will have two tries on each question. This is timed, 10 minutes to complete. the highest grade will be posted to the grade book. </p>', NULL, '2020-10-13 09:32:14', '2020-10-13 09:32:15', NULL, 'https://canvas-lms.ga/courses/10/quizzes/45/submissions?zip=1', NULL, NULL),
(99, 462, 76, 'Mendelian Genetics', 39, 'https://canvas-lms.ga/courses/10/assignments/462', 10, '<p>Two tries, 10 minutes. Highest grade is recorded. Good luck.</p>', NULL, '2020-10-13 09:32:17', '2020-10-13 09:32:17', NULL, 'https://canvas-lms.ga/courses/10/quizzes/49/submissions?zip=1', NULL, NULL),
(100, 461, 76, 'Cells', 39, 'https://canvas-lms.ga/courses/10/assignments/461', 10, '<p>You will have multiple tries on this quiz. You must score above an 85% to move on. You can only complete this quiz once your cell chapter is complete in the review book.</p>', NULL, '2020-10-13 09:32:16', '2020-10-13 09:32:16', NULL, 'https://canvas-lms.ga/courses/10/quizzes/48/submissions?zip=1', NULL, NULL),
(101, 460, 76, 'Energy Self Guided', 39, 'https://canvas-lms.ga/courses/10/assignments/460', 10, '<p>You have multiple tries to achieve an 85% to move on. Remember the highest grade is recorded. </p>', NULL, '2020-10-13 09:32:15', '2020-10-13 09:32:15', NULL, 'https://canvas-lms.ga/courses/10/quizzes/46/submissions?zip=1', NULL, NULL),
