(103, 473, 76, 'Exam Chapters 18-20', 40, 'https://canvas-lms.ga/courses/10/assignments/473', 10, '<p>In class exam covers chapters 19-21</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:32:20', '2020-10-13 09:32:27', NULL, 'https://canvas-lms.ga/courses/10/assignments/473/submissions?zip=1', NULL, NULL),
