(105, 494, 76, 'Summary of Research project', 41, 'https://canvas-lms.ga/courses/10/assignments/494', 10, '<p>This is due for every student by 8:00am</p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"summary of research.pdf\" href=\"https://canvas-lms.ga/courses/10/files/460/download?verifier=6IYHMgRH0qoJ3XC2VZ0HQIpkqIRaAmkLRrFFyu9E&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/460\" data-api-returntype=\"File\">summary of research.pdf</a></p>\n<p>I don\'t need full sentences, but this will help you get started on the research portion of your paper. I do NOT want anyone waiting until the last minute as you WILL LOSE 50% OF POINTS if it is late regardless of the reason.  You have over 2 months to complete, so there is not reason not to get it in on time. I will be TOUGH on the due date, so do NOT ask for an extension. Get started and finish early so nothing will cause you to lose any points! </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:32:22', '2020-10-13 09:32:28', NULL, 'https://canvas-lms.ga/courses/10/assignments/494/submissions?zip=1', NULL, NULL),
