(114, 330, 76, 'September 30', 25, 'https://canvas-lms.ga/courses/8/assignments/330', 8, '<p>Yay, today is Friday and Homecoming! So, I found some videos that should help introduce our new topic so we can discuss it. Watch these 2 videos and take notes. (I will be checking that you took notes).</p>\n<p><a id=\"\" class=\"\" title=\"\" href=\"https://youtu.be/accyCUzasa0\" target=\"\">Link</a></p>\n<p> </p>\n<p><a id=\"\" class=\"\" title=\"\" href=\"https://youtu.be/2AFPfg0Como\" target=\"\">Link</a></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:28', '2020-10-13 09:20:28', NULL, 'https://canvas-lms.ga/courses/8/assignments/330/submissions?zip=1', NULL, NULL),
