(116, 392, 76, 'Tuesday October 4', 25, 'https://canvas-lms.ga/courses/8/assignments/392', 8, '<p><span>Hey guys, I will be out today, so I need you to be awesome and diligent for the sub.  You need to work on your chapter 4 review that I handed out yesterday. If you lost the handout it is online in chapter 4 module in canvas. Use the chapter 4 notes to help you. If you have questions I should be available by email. If you get done with time to spare, go ahead and read the fireworks article. We will be discussing it tomorrow. Thanks guys.  </span></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:35', '2020-10-13 09:20:35', NULL, 'https://canvas-lms.ga/courses/8/assignments/392/submissions?zip=1', NULL, NULL),
(117, 369, 76, 'Thursday October 6', 25, 'https://canvas-lms.ga/courses/8/assignments/369', 8, '<p><span>Explain the relationship between electrons and light. Use google or the textbook if you need to, but do not copy and paste an answer. </span></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:32', '2020-10-13 09:20:33', NULL, 'https://canvas-lms.ga/courses/8/assignments/369/submissions?zip=1', NULL, NULL),
(118, 367, 76, 'Thursday October 13th', 25, 'https://canvas-lms.ga/courses/8/assignments/367', 8, '<p><span>I hope you all had a great break! Today each of you will make a comprehensive study guide on Chapter 4. You will use your review worksheet, your Energy and Light POGIL, and any other information from chapter 4 to make it, and then we are going to use your study guides for an activity, so make a good one!</span></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:32', '2020-10-13 09:20:32', NULL, 'https://canvas-lms.ga/courses/8/assignments/367/submissions?zip=1', NULL, NULL),
(119, 249, 76, 'Friday October 14th', 25, 'https://canvas-lms.ga/courses/8/assignments/249', 8, '<p>How does light reveal the behavior of electrons in an atom? (This is what the Electron Energy and Light POGIL was about. Think about the light tubes and colors of flame we saw in the lab. )</p>\n<p> </p>\n<p>Anyone not here: We are continuing to create and study our chapter 4 study guides in preparation of the Chapter 4 test next week. It will be for a grade. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:19', '2020-10-13 09:20:19', NULL, 'https://canvas-lms.ga/courses/8/assignments/249/submissions?zip=1', NULL, NULL),
(120, 390, 76, 'Tuesday October 18', 25, 'https://canvas-lms.ga/courses/8/assignments/390', 8, '<p>I hope you all had a great long weekend! Write the full electron configuration and orbital diagram for cobalt in your science notebooks. ( also the story teller festival threw off my plans, so your test is tomorrow) Also Mole day is Friday, if you would like extra credit there is the make a mole project in module 5. We will also be signing up to bring food for a potluck. It will be a fun day!</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:35', '2020-10-13 09:20:35', NULL, 'https://canvas-lms.ga/courses/8/assignments/390/submissions?zip=1', NULL, NULL),
(121, 416, 76, 'Wednesday October 19', 25, 'https://canvas-lms.ga/courses/8/assignments/416', 8, '<p><span>Today is test day! I highly suggest that you look over the review worksheet from earlier in the chapter. ( hint: several things are taken directly from this sheet). After you have read this draw an atom (any atom you want) in your science notebook under today\'s date and label it \"chapter 4 test- I\'ll show you how orbitals work\".</span></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:38', '2020-10-13 09:20:38', NULL, 'https://canvas-lms.ga/courses/8/assignments/416/submissions?zip=1', NULL, NULL),
