(151, 404, 76, 'Wednesday January 11th', 25, 'https://canvas-lms.ga/courses/8/assignments/404', 8, '<p>Our Lab safety test is today! If you need to review, the lab safety contract is online.</p>\n<p>Todays question: How do scientist solve problems?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:37', '2020-10-13 09:20:37', NULL, 'https://canvas-lms.ga/courses/8/assignments/404/submissions?zip=1', NULL, NULL),
(152, 355, 76, 'Thursday January 12th', 25, 'https://canvas-lms.ga/courses/8/assignments/355', 8, '<p>We are going to start working with the metric system from now through the end of this class.  What are the advantages to using the metric system over the American measurement system in science? </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:31', '2020-10-13 09:20:31', NULL, 'https://canvas-lms.ga/courses/8/assignments/355/submissions?zip=1', NULL, NULL),
(153, 238, 76, 'Friday January 13th', 25, 'https://canvas-lms.ga/courses/8/assignments/238', 8, '<p>Today Is Friday!!!</p>\n<p><strong>Today in class:</strong> We will go over the the metric worksheet from yesterday; then we will start significant figures and scientific notation. </p>\n<p>Anyone who needs to do so will take the lab safety test today; if you made less than a 90 you will need to retake this today as well.</p>\n<p>Graphing practice is to be turned in today!</p>\n<p> </p>\n<p><strong>Bell Ringer question:</strong>  Change 44000000 micrometers  into millimeters and kilometers. </p>\n<p>Then change 0.0000000227 kiloliters into liters and cm<sup>3 </sup>.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:18', '2020-10-13 09:20:18', NULL, 'https://canvas-lms.ga/courses/8/assignments/238/submissions?zip=1', NULL, NULL),
(154, 378, 76, 'Tuesday January 17th', 25, 'https://canvas-lms.ga/courses/8/assignments/378', 8, '<p>I hope you all had a wonderful long weekend!</p>\n<p>What do you know about atoms and elements? Write your answer on  sheet of paper. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:33', '2020-10-13 09:20:33', NULL, 'https://canvas-lms.ga/courses/8/assignments/378/submissions?zip=1', NULL, NULL),
(155, 405, 76, 'Wednesday January 18', 25, 'https://canvas-lms.ga/courses/8/assignments/405', 8, '<p>I hope you are all having a wonderful Wednesday! We are already halfway through the week!!! </p>\n<p><strong>Today in class:</strong> We will practice using significant figures more today. </p>\n<p>We will be starting scientific notation today. </p>\n<p>We will have a quiz on the metric system, significant figures and scientific notation Friday.</p>\n<p><strong>Bell Ringer: </strong></p>\n<p>1. Convert 23 meters into kilometers and millimeters. </p>\n<p>2. Express 12.0 + 13.57 in the correct number of significant figures.</p>\n<p>3. Express 10.00/ 5.0  in the correct number of significant figures.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:37', '2020-10-13 09:20:37', NULL, 'https://canvas-lms.ga/courses/8/assignments/405/submissions?zip=1', NULL, NULL),
(156, 335, 76, 'Significant Figure Practice 2', 25, 'https://canvas-lms.ga/courses/8/assignments/335', 8, '<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"significant figure practice-2.pdf\" href=\"https://canvas-lms.ga/courses/8/files/381/download?verifier=twkjcDIocFm356fN0T6LlMZWYhTInRDfUTKFilBS&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/381\" data-api-returntype=\"File\">significant figure practice-2.pdf</a></p>\n<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"significant figure practice-2.pdf\" href=\"https://canvas-lms.ga/courses/8/files/381/download?verifier=twkjcDIocFm356fN0T6LlMZWYhTInRDfUTKFilBS&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/381\" data-api-returntype=\"File\"></a><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"Significant Digits Arithmetic WorkSheet.doc\" href=\"https://canvas-lms.ga/courses/8/files/386/download?verifier=T3KxHmZM57N42BRr2UU1eaXqyt1CPnjQF5yWfntI&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/386\" data-api-returntype=\"File\">Significant Digits Arithmetic WorkSheet.doc</a></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:28', '2020-10-13 09:20:28', NULL, 'https://canvas-lms.ga/courses/8/assignments/335/submissions?zip=1', NULL, NULL),
(157, 356, 76, 'Thursday January 19th', 25, 'https://canvas-lms.ga/courses/8/assignments/356', 8, '<p>It\'s Thursday, we are mostly through this week already!</p>\n<p>Today in class: We are going to review the metric system, significant figures, and scientific notation today in preparation for our quiz tomorrow. We may also start density. </p>\n<p>Tomorrow: we will play a review game, quiz, and then start properties of matter. </p>\n<p>Bell Ringer:</p>\n<p>1. How many millimeters are in a meter?</p>\n<p>2. what is the numerical value for a dekaliter?</p>\n<p>3. Put 5500000000000 into scientific notation. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:31', '2020-10-13 09:20:31', NULL, 'https://canvas-lms.ga/courses/8/assignments/356/submissions?zip=1', NULL, NULL),
(158, 239, 76, 'Friday January 20th', 25, 'https://canvas-lms.ga/courses/8/assignments/239', 8, '<p>It\'s Friday!!! This school week is over. </p>\n<p><strong>Today in class:</strong> We will play a review game, and quiz on the metric system, significant figures, and scientific notation. After the quiz we will start on properties of matter.</p>\n<p><strong>Bell Ringer: </strong></p>\n<p>What is density?</p>\n<p>What is the formula for density?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:18', '2020-10-13 09:20:18', NULL, 'https://canvas-lms.ga/courses/8/assignments/239/submissions?zip=1', NULL, NULL),
(159, 291, 76, 'Monday January 23', 25, 'https://canvas-lms.ga/courses/8/assignments/291', 8, '<p>I hope you all have a good weekend.</p>\n<p><strong>Today in class:</strong> We will be discussing the difference between accuracy and precision. Then, we will be starting on the properties of matter. </p>\n<p><strong>Bell Ringer question:  </strong>Without looking it up, tell me what you think is the difference between accuracy and precision. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:24', '2020-10-13 09:20:24', NULL, 'https://canvas-lms.ga/courses/8/assignments/291/submissions?zip=1', NULL, NULL),
(160, 379, 76, 'Tuesday January 24', 25, 'https://canvas-lms.ga/courses/8/assignments/379', 8, '<p>Today in class: More classifying of materials!</p>\n<p>Tomorrow: Isolating chemicals from mixtures lab.</p>\n<p>Bell ringer: Explain the difference between an element, compound, and a mixture. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:34', '2020-10-13 09:20:34', NULL, 'https://canvas-lms.ga/courses/8/assignments/379/submissions?zip=1', NULL, NULL),
(161, 406, 76, 'Wednesday January 25', 25, 'https://canvas-lms.ga/courses/8/assignments/406', 8, '<p>We are officially half way through the week!!!</p>\n<p>Today in class: we will do the pre-lab for the kool-aid lab in class, then we will go into the lab to perform chromatography on mixture to isolate out chemicals. </p>\n<p> </p>\n<p>Bell Ringer: What are intensive and extensive properties?</p>\n<p>After you are done with the bell ringer start reading the kool-aid lab procedure located in module 1 in cannvas. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:37', '2020-10-13 09:20:37', NULL, 'https://canvas-lms.ga/courses/8/assignments/406/submissions?zip=1', NULL, NULL),
(162, 357, 76, 'Thursday January 26', 25, 'https://canvas-lms.ga/courses/8/assignments/357', 8, '<p>The week is almost over!</p>\n<p><strong>Today in class:</strong> We will finish chapter 1 notes, discuss more about intensive and extensive properties. </p>\n<p><strong>Tomorrow:</strong> your completed lab reports are due. </p>\n<p><strong>Bell Ringer:</strong> how did separating the dye out of the koolaid prove that it was a mixture?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:31', '2020-10-13 09:20:31', NULL, 'https://canvas-lms.ga/courses/8/assignments/357/submissions?zip=1', NULL, NULL),
(163, 240, 76, 'Friday January 27', 25, 'https://canvas-lms.ga/courses/8/assignments/240', 8, '<p>It is finally Friday!</p>\n<p>Today in class: your lab report is due. You will have a few minutes to finish it up, then we will be discussing law of conservation of mass and we will play quizlet live with the chapter 1 vocabulary. </p>\n<p> </p>\n<p>Bell Ringer: What is plasma? Also if a chemical is listed as a solution, what does this tell you about the chemical?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:18', '2020-10-13 09:20:18', NULL, 'https://canvas-lms.ga/courses/8/assignments/240/submissions?zip=1', NULL, NULL),
(164, 395, 76, 'Vocabulary Quizlet', 25, 'https://canvas-lms.ga/courses/8/assignments/395', 8, '<p><a id=\"\" class=\"\" title=\"\" href=\"https://quizlet.com/_31lrwx\" target=\"\">Link</a></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:35', '2020-10-13 09:20:35', NULL, 'https://canvas-lms.ga/courses/8/assignments/395/submissions?zip=1', NULL, NULL),
(165, 292, 76, 'Monday, January 30th', 25, 'https://canvas-lms.ga/courses/8/assignments/292', 8, '<p>Welcome back to school on this glorious, albeit cold Monday!</p>\n<p><strong>Today in class: </strong>We will review for the vocabulary quiz tomorrow, I will give you a grade for the review 1 worksheet that you completed Friday, and we will complete review worksheet 2 today in class. Your Chapter 1 test will be Thursday.</p>\n<p><strong>Tomorrow: </strong>We will take a vocabulary quiz, and start talking about atoms. </p>\n<p><strong>Bell Ringer:</strong> What information does the periodic table give you about an element? Be specific. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:24', '2020-10-13 09:20:24', NULL, 'https://canvas-lms.ga/courses/8/assignments/292/submissions?zip=1', NULL, NULL),
(166, 380, 76, 'Tuesday, January 31st', 25, 'https://canvas-lms.ga/courses/8/assignments/380', 8, '<p><strong>Today in class:</strong> We will play quizlet live to prepare for the vocabulary quiz, then we will discuss bonding and annotate the periodic table. </p>\n<p><strong>Tomorrow: </strong>You will complete review worksheet 2, and get into groups to do study games. </p>\n<p><strong>Thursday Is your chapter 1 test!</strong></p>\n<p><strong>Bell Ringer:</strong></p>\n<p>What is a valence shell?</p>\n<p>What is a valence electron?</p>\n<p>Why is this information important to chemical bonding?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:34', '2020-10-13 09:20:34', NULL, 'https://canvas-lms.ga/courses/8/assignments/380/submissions?zip=1', NULL, NULL),
(167, 401, 76, 'Wednesday, February 1st', 25, 'https://canvas-lms.ga/courses/8/assignments/401', 8, '<p>Hi everyone! as discussed I will not be here today or tomorrow. That being said you still have a bell ringer both days and you still have your chapter 1 test tomorrow. </p>\n<p><strong>Today In Class:</strong> You will break into your groups of 5, and you will each have 15 questions to answer. Sophie\'s group will take the 1st 15, Maddie\'s group will take the 2nd 15, and Bryce\'s group will take the last 15. You will then take a few minutes to discuss your answers with the rest of the class and then one person from each group will quiz the class. The group with the 1st correct answer will get a point, the group with the most points gets 5 bonus points on the test. </p>\n<p><strong>Tomorrow:</strong> Chapter 1 test. </p>\n<p><strong>Bell Ringer:</strong> What are the 3 major types of chemical bonds and how do we determine how atoms will form those bonds?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:36', '2020-10-13 09:20:36', NULL, 'https://canvas-lms.ga/courses/8/assignments/401/submissions?zip=1', NULL, NULL),
(168, 353, 76, 'Thursday, February 2nd', 25, 'https://canvas-lms.ga/courses/8/assignments/353', 8, '<p>Good morning ladies and gentlemen! Thank you for working diligently yesterday. Also, congratulations to Cade, Chase, Bryce, Evan, and Jonathan for winning the 5 bonus points of your test! Although, Sophie and Tyriq, with how competitive you both are I was almost surprised to hear the result. But good job, to all of you. I hope you are well prepared for the test. </p>\n<p><strong>Today in class: </strong>Chapter 1 Test, Good Luck!</p>\n<p><strong>Tomorrow in class: </strong>NaCl lab</p>\n<p><strong>Bell Ringer:</strong> This is for 1 bonus point on your test as well as your daily bell ringer grade. </p>\n<p>How much wood could a woodchuck chuck if a woodchuck could chuck wood?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:31', NULL, 'https://canvas-lms.ga/courses/8/assignments/353/submissions?zip=1', NULL, NULL),
(169, 237, 76, 'Friday, February 3rd', 25, 'https://canvas-lms.ga/courses/8/assignments/237', 8, '<p>Happy Friday! Your tests are half graded, and will hopefully be finished by Monday. Good news about the tests is that I have decided to make the short answer question bonus points, bad news is that no one made a 100 naturally,  :( </p>\n<p><strong>Today in class: </strong>NaCl lab! Lab reports will be due Wednesday.</p>\n<p><strong>Monday:</strong> We will start chapter 3.</p>\n<p><strong>Bell Ringer:</strong> How would you determine how much of a solution was a particular substance?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:18', '2020-10-13 09:20:18', NULL, 'https://canvas-lms.ga/courses/8/assignments/237/submissions?zip=1', NULL, NULL),
(170, 208, 76, 'Chapter 1 study guide 2/1/17', 25, 'https://canvas-lms.ga/courses/8/assignments/208', 8, '<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"chapter1_studyguide.doc\" href=\"https://canvas-lms.ga/courses/8/files/390/download?verifier=kgdgxXRlsX3WcFVUyNMsLjY7G21Qmz6yTVu38qhf&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/390\" data-api-returntype=\"File\">chapter1_studyguide.doc</a></p>\n<p> </p>\n<p>A few of the questions did not make it onto the study guide, deal with it as best you can. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:14', '2020-10-13 09:20:14', NULL, 'https://canvas-lms.ga/courses/8/assignments/208/submissions?zip=1', NULL, NULL),
(171, 290, 76, 'Monday, February 6th', 25, 'https://canvas-lms.ga/courses/8/assignments/290', 8, '<p>Good Afternoon, I hope you all had a good weekend!</p>\n<p><strong>Today in class:</strong> We will start module 3, and begin discussing the atom and the various molecular models that lead us to the current quantum mechanical model.</p>\n<p><strong>Bell Ringer:</strong> If your solution had more substances in it than just pure water and salt, would you be able to use the same method as Friday to separate the mixture?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:24', '2020-10-13 09:20:24', NULL, 'https://canvas-lms.ga/courses/8/assignments/290/submissions?zip=1', NULL, NULL),
(172, 376, 76, 'Tuesday, February 7th', 25, 'https://canvas-lms.ga/courses/8/assignments/376', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:33', '2020-10-13 09:20:33', NULL, 'https://canvas-lms.ga/courses/8/assignments/376/submissions?zip=1', NULL, NULL),
(173, 403, 76, 'Wednesday, February 8th', 25, 'https://canvas-lms.ga/courses/8/assignments/403', 8, '<p>Good afternoon! We are half way through the week and your lab reports are due today. </p>\n<p><strong>Today in class:</strong> We will calculate the relative abundance of isotopes to determine average molecular weigh, and we will also practice using dimensional analysis. Have your calculators today!</p>\n<p><strong>Tomorrow in class:</strong> Law of Definite Proportions lab</p>\n<p><strong>BellRinger:</strong> Why do the atomic masses on the periodic table have decimal point when we know that protons and neutrons come together in whole numbers only?</p>\n<p>How do we determine which isotope is most common from the information presented on the periodic table?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:37', '2020-10-13 09:20:37', NULL, 'https://canvas-lms.ga/courses/8/assignments/403/submissions?zip=1', NULL, NULL),
(174, 354, 76, 'Thursday, February 9th', 25, 'https://canvas-lms.ga/courses/8/assignments/354', 8, '<p>So there is some good and bad news. The good news is that the week is almost over. The bad news is that your class no longer gets any candy privileges, because after you left I found candy wrappers left in the classroom. And that was after I let you have candy even though the class was overly rambunctious and would not listen as I was going over problems yesterday. So, no more candy.</p>\n<p>Today In class: We will perform and take data from the Law of Definite Proportions Lab. If you behave in the lab the way you did in class yesterday, we will leave the lab and everyone will receive a zero for your lab grade no questions asked. </p>\n<p>Dimensional analysis practice from yesterday is do at the end of class today. </p>\n<p>Tomorrow: we will be calculating Atomic mass using the relative abundance of isotopes.</p>\n<p>Bell Ringer: Convert 120062 meters per second to miles per minute. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:31', '2020-10-13 09:20:31', NULL, 'https://canvas-lms.ga/courses/8/assignments/354/submissions?zip=1', NULL, NULL),
(175, 235, 76, 'Friday, February 10th', 25, 'https://canvas-lms.ga/courses/8/assignments/235', 8, '<p><strong>Happy Friday!!!</strong></p>\n<p><strong>Today in class:</strong> we will be calculating some relative abundances and doing an activity along those lines. </p>\n<p>If you did not turn in your dimensional analysis worksheet yesterday I need it on the front table or in my hand before we begin class. </p>\n<p>Lab reports are due Monday.</p>\n<p><strong>Bell Ringer</strong>: How did yesterdays lab relate to the law of definite proportions?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:17', '2020-10-13 09:20:17', NULL, 'https://canvas-lms.ga/courses/8/assignments/235/submissions?zip=1', NULL, NULL),
(176, 302, 76, 'NaCl lab report submission link', 25, 'https://canvas-lms.ga/courses/8/assignments/302', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:25', '2020-10-13 09:20:25', NULL, 'https://canvas-lms.ga/courses/8/assignments/302/submissions?zip=1', NULL, NULL),
(177, 288, 76, 'Monday, February 13th', 25, 'https://canvas-lms.ga/courses/8/assignments/288', 8, '<p>Bell Ringer: How did the sugar lab prove the law of definite proportions?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:23', NULL, 'https://canvas-lms.ga/courses/8/assignments/288/submissions?zip=1', NULL, NULL),
(178, 344, 76, 'Submit POGIL here', 25, 'https://canvas-lms.ga/courses/8/assignments/344', 8, '<p><a class=\"\" href=\"https://youtu.be/xirPkCI1sMA\">https://youtu.be/xirPkCI1sMA</a></p>\n<p> </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:29', '2020-10-13 09:20:30', NULL, 'https://canvas-lms.ga/courses/8/assignments/344/submissions?zip=1', NULL, NULL),
(179, 186, 76, 'Atomic History', 25, 'https://canvas-lms.ga/courses/8/assignments/186', 8, '<p>Several key scientists contributed to our understanding of the atom.The scientists are <strong>Democritus, John Dalton, J.J. Thomson, Robert Millikan, and Ernest Rutherford</strong>.  For each of those people, I would like you to use your book, or any other resource you would like, to determine what he contributed to the atomic model we now use.  Do this in a <strong>google slide share</strong> with your group members and be sure to include pictures.</p>\n<p>Each group member will need to turn in a link to the file share and explain their contribution to the project in this submission box to get credit for the assignment. </p>\n<p>What did each \"discover?\"  </p>\n<p>How did it improve or disprove something that came before?  </p>\n<p>How did he find out the information?   </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:12', '2020-10-13 09:20:12', NULL, 'https://canvas-lms.ga/courses/8/assignments/186/submissions?zip=1', NULL, NULL),
(180, 400, 76, 'Wednesday February 15th', 25, 'https://canvas-lms.ga/courses/8/assignments/400', 8, '<p>I hope you all had a wonderful valentines day, and I hope you enjoyed your Chemist Tea Party yesterday even though I could not be there. </p>\n<p><strong>Today in class:</strong> you will need to turn in your POGIL, which no one did yet.</p>\n<p>You will also need to work on the Atomic History assignment that is in module 3, in groups of no more than 4 people per group.</p>\n<p>After that you will probably need to watch the composition stoichiometry review videos and then do compositional stoichiometry practice 1 and 2 that are also in chapter 3 modules. </p>\n<p><strong>Bell Ringer:</strong> How did it go yesterday? Was there a particular tea you liked or didn\'t like? Tell me about your day. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:36', '2020-10-13 09:20:36', NULL, 'https://canvas-lms.ga/courses/8/assignments/400/submissions?zip=1', NULL, NULL),
(181, 351, 76, 'Thursday, February 16th', 25, 'https://canvas-lms.ga/courses/8/assignments/351', 8, '<p> </p>\n<p>Today in class: We will discuss the atomic model and we will perform the comosition stoicheometry practice together, since no one seemingly did it yesterday.   </p>\n<p> </p>\n<p>Bell Ringer: What is the atomic model we currently use and how was it developed?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:30', NULL, 'https://canvas-lms.ga/courses/8/assignments/351/submissions?zip=1', NULL, NULL),
(182, 402, 76, 'Wednesday February 22', 25, 'https://canvas-lms.ga/courses/8/assignments/402', 8, '<p>Today in class: We will review the composition stoichiometry and atomic history.</p>\n<p>Friday is the Chapter 3 test.</p>\n<p>Bell Ringer: what is Avogadro\'s number and what does it represent?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:36', '2020-10-13 09:20:36', NULL, 'https://canvas-lms.ga/courses/8/assignments/402/submissions?zip=1', NULL, NULL),
(183, 352, 76, 'Thursday February 23', 25, 'https://canvas-lms.ga/courses/8/assignments/352', 8, '<p><strong>Today in class:</strong> Chapter 3 Review</p>\n<p><strong>Tomorrow: Test</strong></p>\n<p><strong>Bell Ringer:</strong> Convert 15.33 x 10^18 atoms of Carbon into grams. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:30', NULL, 'https://canvas-lms.ga/courses/8/assignments/352/submissions?zip=1', NULL, NULL),
(184, 236, 76, 'Friday February 24th', 25, 'https://canvas-lms.ga/courses/8/assignments/236', 8, '<p>Today is test day!!!</p>\n<p><strong>Today in class:</strong> we will have a few minutes to review before the test, but I have no voice, and can not speak above a whisper, so you will have  to listen closely. </p>\n<p> </p>\n<p><strong>Bell Ringer: </strong>Why do you have to account for relative abundance when calculating average atomic mass? Why can you not just average them like you would average numbers in math?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:17', '2020-10-13 09:20:17', NULL, 'https://canvas-lms.ga/courses/8/assignments/236/submissions?zip=1', NULL, NULL),
(185, 289, 76, 'Monday February 27th', 25, 'https://canvas-lms.ga/courses/8/assignments/289', 8, '<p><strong>Good Afternoon! My voice still sucks, so you will have to do the bulk of the talking today! </strong></p>\n<p><strong>Today in class:</strong> we will start chapter 4 notes and electron configuration.</p>\n<p><strong>Bell Ringer:</strong> What is the relationship between atoms and light?</p>\n<p> </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:24', NULL, 'https://canvas-lms.ga/courses/8/assignments/289/submissions?zip=1', NULL, NULL),
