(188, 408, 76, 'Wednesday March 1st', 25, 'https://canvas-lms.ga/courses/8/assignments/408', 8, '<p>Bell ringer: What was the purpose of yesterdays lab?</p>\n<p>Today in class: after the hecticness of the day, with so few people in class, we continued watching The Martian. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:37', '2020-10-13 09:20:37', NULL, 'https://canvas-lms.ga/courses/8/assignments/408/submissions?zip=1', NULL, NULL);
INSERT INTO `assignment` (`id`, `assignment_id`, `user_id`, `name`, `assignment_group_id`, `html_url`, `course_id`, `description`, `due_at`, `created_at`, `updated_at`, `all_dates`, `submissions_download_url`, `quiz_id`, `discussion_topic`) VALUES
(189, 360, 76, 'Thursday March 2nd', 25, 'https://canvas-lms.ga/courses/8/assignments/360', 8, '<p>Today in class: we will complete the light spectrometry lab. </p>\n<p>Due tomorrow: Light spectrometry lab, Light and energy POGIL, lab purpose and procedure for flame test lab. </p>\n<p>All makeup work is due no later than Tuesday. After you have turned in all online assignments, please send me just 1 email in cannvas with a list of the assignments turned in. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:31', '2020-10-13 09:20:32', NULL, 'https://canvas-lms.ga/courses/8/assignments/360/submissions?zip=1', NULL, NULL),
(190, 244, 76, 'Friday, March 3rd', 25, 'https://canvas-lms.ga/courses/8/assignments/244', 8, '<p>It is Friday! Only ONE full week left till SPRING BREAK!</p>\n<p><strong>Today in class:</strong> We will go into the lab to do the Flame test. </p>\n<p><strong>Due today:</strong> POGIL, Light spectrometry lab.</p>\n<p>All makeup work due by Tuesday!</p>\n<p><strong>Bell Ringer:</strong> How do fireworks get their colors?</p>\n<p><img src=\"https://canvas-lms.ga/courses/8/files/378/preview?verifier=nfbUCkXywSZlLQKUdj6D8LMgUoFdyePuhYynswYL\" alt=\"Chemistry cat traveling light.jpg\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/378\" data-api-returntype=\"File\"></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:18', '2020-10-13 09:20:19', NULL, 'https://canvas-lms.ga/courses/8/assignments/244/submissions?zip=1', NULL, NULL),
(191, 295, 76, 'Monday March 6th', 25, 'https://canvas-lms.ga/courses/8/assignments/295', 8, '<p>Good Afternoon! I hope everyone had a good weekend.</p>\n<p><strong>Today in class:</strong> We will be discussing and practicing electron orbital diagrams.</p>\n<p><span style=\"color: #ff0000;\"><strong>All Makeup/ missing work is due Tomorrow!</strong></span></p>\n<p><strong>Bell Ringer:</strong> Explain the relationship between wavelength and energy. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:24', '2020-10-13 09:20:24', NULL, 'https://canvas-lms.ga/courses/8/assignments/295/submissions?zip=1', NULL, NULL),
(192, 383, 76, 'Tuesday March 7th', 25, 'https://canvas-lms.ga/courses/8/assignments/383', 8, '<p>Today in class: We will Practice our orbital Diagrams, and do a who is who of scientist.</p>\n<p> </p>\n<p>Bell Ringer: All noble gasses end in what type of orbital?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:34', '2020-10-13 09:20:34', NULL, 'https://canvas-lms.ga/courses/8/assignments/383/submissions?zip=1', NULL, NULL),
(193, 411, 76, 'Wednesday March 8th', 25, 'https://canvas-lms.ga/courses/8/assignments/411', 8, '<p>Today in class: we will finish discussing orbital diagrams and review for tomorrows test.</p>\n<p>Bell Ringer: By what principle do electron orbits fill with the up arrow before adding a downward spinning electron?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:38', '2020-10-13 09:20:38', NULL, 'https://canvas-lms.ga/courses/8/assignments/411/submissions?zip=1', NULL, NULL),
(194, 362, 76, 'Thursday March 9th', 25, 'https://canvas-lms.ga/courses/8/assignments/362', 8, '<p>Today in class: Chapter 4 test</p>\n<p> </p>\n<p>Bell Ringer: What is the visible spectrum of light?</p>\n<p> </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:32', '2020-10-13 09:20:32', NULL, 'https://canvas-lms.ga/courses/8/assignments/362/submissions?zip=1', NULL, NULL),
(195, 242, 76, 'Friday March 10th', 25, 'https://canvas-lms.ga/courses/8/assignments/242', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:18', '2020-10-13 09:20:18', NULL, 'https://canvas-lms.ga/courses/8/assignments/242/submissions?zip=1', NULL, NULL),
(196, 294, 76, 'Monday, March 20th', 25, 'https://canvas-lms.ga/courses/8/assignments/294', 8, '<p>I hope you all had a wonderful long break!</p>\n<p><strong>Today in class:</strong> We will start Chapter 5 about periodic trends. </p>\n<p><strong>Tomorrow: </strong>Practice using the information about  the periodic trends.</p>\n<p><strong>Test no later than Friday!</strong></p>\n<p><strong>Bell Ringer:</strong> Tell me about your spring break in a complete paragraph, using proper sentence structure and punctuation. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:24', '2020-10-13 09:20:52', NULL, 'https://canvas-lms.ga/courses/8/assignments/294/submissions?zip=1', NULL, NULL),
(197, 381, 76, 'Tuesday March 21st', 25, 'https://canvas-lms.ga/courses/8/assignments/381', 8, '<p><strong>Today in class:</strong> We will finish chapter 5 notes. Then you will work on the Atomic trends POGIL. </p>\n<p><strong>Tomorrow in class:</strong> We will do some of the review sheets</p>\n<p><strong>Bell Ringer:</strong> Which groups from the periodic table will form cations and which will form anions; why?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:34', '2020-10-13 09:20:56', NULL, 'https://canvas-lms.ga/courses/8/assignments/381/submissions?zip=1', NULL, NULL),
(198, 409, 76, 'Wednesday March 22nd', 25, 'https://canvas-lms.ga/courses/8/assignments/409', 8, '<p>I hope you enjoyed yesterday while it was sunny, because we are going to have <strong>rain all weekend</strong>. ToT</p>\n<p><strong>Today in class:</strong> Your POGIL is due today. If we have time I will give you some to work on the pogil. However I also want to start some of the reviews. Your test is Friday. </p>\n<p><strong>Bell Ringer:</strong> Why are the trends of Ionization energy and electronegativity the same? Why are they opposite of the trend for atomic radius?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:37', '2020-10-13 09:20:57', NULL, 'https://canvas-lms.ga/courses/8/assignments/409/submissions?zip=1', NULL, NULL),
(199, 394, 76, 'Turn POGIL in here', 25, 'https://canvas-lms.ga/courses/8/assignments/394', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:35', '2020-10-13 09:20:35', NULL, 'https://canvas-lms.ga/courses/8/assignments/394/submissions?zip=1', NULL, NULL),
(200, 359, 76, 'Thursday March 23rd', 25, 'https://canvas-lms.ga/courses/8/assignments/359', 8, '<p><strong>Today in class:</strong> we will be finishing up the review worksheets and doing the chapter 5 practice test.</p>\n<p><strong>Tomorrow: Chapter 5 test!</strong></p>\n<p><strong>Bell Ringer:</strong> Explain why the larger the atomic radius the less electronegativity. Use the shielding effect in your explanation. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:31', '2020-10-13 09:20:55', NULL, 'https://canvas-lms.ga/courses/8/assignments/359/submissions?zip=1', NULL, NULL),
(201, 382, 76, 'Tuesday March 28th', 25, 'https://canvas-lms.ga/courses/8/assignments/382', 8, '<p>I hope you all enjoyed leaving early yesterday!</p>\n<p><strong>Today in class:</strong> We will be starting chapter 6 on molecular bonding! yay! It is at the least more interesting than the last chapter. </p>\n<p>Also, I have<strong> not</strong> graded your tests yet, so please do not ask.</p>\n<p> </p>\n<p><strong>Bell Ringer:</strong> What is one of the most basic ways to determine the bond type that will form between compounds?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:34', '2020-10-13 09:20:56', NULL, 'https://canvas-lms.ga/courses/8/assignments/382/submissions?zip=1', NULL, NULL),
(202, 410, 76, 'Wednesday March 29th', 25, 'https://canvas-lms.ga/courses/8/assignments/410', 8, '<p>Today in class: Since I have been informed that no one reads what we are going to do in class, I have decided to stop telling you and just let it be a surprise! Also try to say pink flamingos do flamingo dancing on the fandango site 5 times fast.</p>\n<p> </p>\n<p>Bell Ringer: How do we determine how many of each element are going to be required to form a bond? </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:38', '2020-10-13 09:20:57', NULL, 'https://canvas-lms.ga/courses/8/assignments/410/submissions?zip=1', NULL, NULL),
(203, 361, 76, 'Thursday March 30th', 25, 'https://canvas-lms.ga/courses/8/assignments/361', 8, '<p>Today in class: we will be working more with predicting bond types. Then we will work some on molecular geometry.</p>\n<p> </p>\n<p>Bell Ringer: If you did not have an electronegativity chart, how would you determine if a covalent bond is polar or non-polar?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:32', '2020-10-13 09:20:55', NULL, 'https://canvas-lms.ga/courses/8/assignments/361/submissions?zip=1', NULL, NULL),
(204, 243, 76, 'Friday March 31st', 25, 'https://canvas-lms.ga/courses/8/assignments/243', 8, '<p>Today in class: you are going to work on the molecular geometry pogil. <strong>You need to start this when you get into class!</strong></p>\n<p><strong>Grading:</strong> Also I need to see your homework. This is the ionic bonding that I didn\'t get to check yesterday and the Covalent bonding 2 wks. This is also the last day I will accept your Quizlets. </p>\n<p> </p>\n<p>Bell Ringer: How many electrons are being shared between a single bond, double bond, and triple bond?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:18', '2020-10-13 09:20:50', NULL, 'https://canvas-lms.ga/courses/8/assignments/243/submissions?zip=1', NULL, NULL),
(205, 282, 76, 'Molecular Geometry POGIL', 25, 'https://canvas-lms.ga/courses/8/assignments/282', 8, '<p><a id=\"\" class=\"\" title=\"\" href=\"https://drive.google.com/a/acs-k12.org/file/d/0B-x7KXj4oNyAMHVRLUNUdzZZcnc/view?usp=sharing\" target=\"\">Molecular Geometry POGIL</a></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:51', NULL, 'https://canvas-lms.ga/courses/8/assignments/282/submissions?zip=1', NULL, NULL),
(206, 287, 76, 'Monday, April 3rd', 25, 'https://canvas-lms.ga/courses/8/assignments/287', 8, '<p>Today in class: We are going to finish up chapter 6, and review any questions you have.</p>\n<p>Tomorrow: The end of series beta testing.</p>\n<p>Bell Ringer: How do lewis dot bonding structures differ between ionic and covalent bonds?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:52', NULL, 'https://canvas-lms.ga/courses/8/assignments/287/submissions?zip=1', NULL, NULL),
(207, 374, 76, 'Tuesday, April 4th', 25, 'https://canvas-lms.ga/courses/8/assignments/374', 8, '<p>Today in class: Achievement series beta testing. At the end of the test, it will let you see how many you missed, and how many you got right, I need to see this page before you finish!!!!</p>\n<p> </p>\n<p>Website for test: <a href=\"http://www.achievementseries.com\">www.achievementseries.com</a> </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:33', '2020-10-13 09:20:33', NULL, 'https://canvas-lms.ga/courses/8/assignments/374/submissions?zip=1', NULL, NULL),
(208, 399, 76, 'Wednesday April 5th', 25, 'https://canvas-lms.ga/courses/8/assignments/399', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:36', '2020-10-13 09:20:36', NULL, 'https://canvas-lms.ga/courses/8/assignments/399/submissions?zip=1', NULL, NULL),
(209, 349, 76, 'Thursday April 6th', 25, 'https://canvas-lms.ga/courses/8/assignments/349', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:30', NULL, 'https://canvas-lms.ga/courses/8/assignments/349/submissions?zip=1', NULL, NULL),
(210, 233, 76, 'Friday,  April 7th', 25, 'https://canvas-lms.ga/courses/8/assignments/233', 8, '<p>Today in class: We will do a quick review, then you will take a quick chapter 6 test. </p>\n<p> </p>\n<p>Bell Ringer: The chemical formula for methane is CH<sub>4 ,</sub> What could another name for it be?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:17', '2020-10-13 09:20:50', NULL, 'https://canvas-lms.ga/courses/8/assignments/233/submissions?zip=1', NULL, NULL),
(211, 284, 76, 'Monday, April 10th', 25, 'https://canvas-lms.ga/courses/8/assignments/284', 8, '<p>We are very far behind, so there will be no time to waste these next few weeks. </p>\n<p>Today in Class: We will be starting chapter 7 notes, then we will practice determining formulas for Ionic compounds based on their names. </p>\n<p> </p>\n<p>Bell Ringer: After grading your tests, I feel I have to ask; What is the difference in electron movement between ionic compounds and covalent compounds. (If you answer flippantly you will receive a zero for he assignment.)</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:52', NULL, 'https://canvas-lms.ga/courses/8/assignments/284/submissions?zip=1', NULL, NULL),
(212, 371, 76, 'Tuesday, April 11th', 25, 'https://canvas-lms.ga/courses/8/assignments/371', 8, '<p>Today in class: We will go over the answers to the homework, then we will begin discussing the difference between ionic and covalent nomenclature.</p>\n<p> </p>\n<p>Bell Ringer: what is the difference between oxide, hydride, and hydroxide?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:33', '2020-10-13 09:20:55', NULL, 'https://canvas-lms.ga/courses/8/assignments/371/submissions?zip=1', NULL, NULL),
(213, 396, 76, 'Wednesday, April 12th', 25, 'https://canvas-lms.ga/courses/8/assignments/396', 8, '<p><strong>Today in class:</strong> We will get more practice with nomenclature, and hopefully we will have enough time to start molecular weight.</p>\n<p>If you finished the nomenclature worksheet 1 as homework turn it in before we start going over the answers to receive your extra credit. </p>\n<p><span style=\"color: #ff0000;\"><strong>If you have failed a test</strong></span>, I will let you do a re-take. You need to let me know a time that you can come to retake the test. </p>\n<p><strong>Bell Ringer:</strong> How do you determine which naming scheme you need to use when naming chemical compounds?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:35', '2020-10-13 09:20:56', NULL, 'https://canvas-lms.ga/courses/8/assignments/396/submissions?zip=1', NULL, NULL),
(214, 346, 76, 'Thursday, April 13th', 25, 'https://canvas-lms.ga/courses/8/assignments/346', 8, '<p>I hope you all had a wonderful long Easter weekend. </p>\n<p> </p>\n<p>Today in class: we will be practicing more with nomenclature, and formula weight.</p>\n<p> </p>\n<p>Bell Ringer: what is the name and formula weight of Mg(OH)<sub>2</sub>? </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:54', NULL, 'https://canvas-lms.ga/courses/8/assignments/346/submissions?zip=1', NULL, NULL),
(215, 285, 76, 'Monday, April 17th', 25, 'https://canvas-lms.ga/courses/8/assignments/285', 8, '<div class=\"assignment-title\">\n<div class=\"assignment-buttons\">\n<a class=\"btn edit_assignment_link\" href=\"https://canvas-lms.ga/courses/8/assignments/346\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/assignments/346\" data-api-returntype=\"Assignment\"><i class=\"icon-edit\"></i> Edit</a> <a class=\"al-trigger btn\" role=\"button\" aria-haspopup=\"true\" aria-owns=\"toolbar-1\" href=\"https://canvas-lms.ga/courses/8/assignments/346\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/assignments/346\" data-api-returntype=\"Assignment\"><i class=\"icon-settings\"></i> <i class=\"icon-mini-arrow-down\"></i><span class=\"screenreader-only\">Manage</span></a>\n</div>\n</div>\n<div class=\"clear\"></div>\n<div class=\"clear\"></div>\n<div class=\"description user_content teacher-version enhanced\">\n<p>I hope you all had a wonderful long Easter weekend. </p>\n<p> </p>\n<p>Today in class: we will be practicing more with nomenclature, and formula weight.</p>\n<p> </p>\n<p>Bell Ringer: what is the name and formula weight of Mg(OH)<sub>2</sub>? </p>\n</div>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:52', NULL, 'https://canvas-lms.ga/courses/8/assignments/285/submissions?zip=1', NULL, NULL),
(216, 372, 76, 'Tuesday, April 18th', 25, 'https://canvas-lms.ga/courses/8/assignments/372', 8, '<p>Today in class: we will discuss the difference between molecular formula and empirical formula, then you will practice empirical formulas and determining formula from mass. </p>\n<p> </p>\n<p>Chapter 7 Test Friday!</p>\n<p>Bell Ringer:  If I told you a Compound was 11.21% Hydrogen and 88.79% Oxygen, what would the compound be?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:33', '2020-10-13 09:20:55', NULL, 'https://canvas-lms.ga/courses/8/assignments/372/submissions?zip=1', NULL, NULL),
(217, 397, 76, 'Wednesday, April 19th', 25, 'https://canvas-lms.ga/courses/8/assignments/397', 8, '<p>Today most of you are taking the ACT or the ASPIRE. </p>\n<p>If you are not taking the ACT you need to do this assignment to get credit for being here today as an e-learning day.</p>\n<p> </p>\n<p> </p>\n<p>Tell me what you still have trouble with in this section. If you really need extra practice you need to pick 5 questions from worksheet to use for practice, or I will find an assignment for you. let me know. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:36', '2020-10-13 09:20:56', NULL, 'https://canvas-lms.ga/courses/8/assignments/397/submissions?zip=1', NULL, NULL),
(218, 347, 76, 'Thursday, April 20th', 25, 'https://canvas-lms.ga/courses/8/assignments/347', 8, '<p>Today in class it is ch 7 review. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: remind me to talk to you about mole day tomorrow. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:30', NULL, 'https://canvas-lms.ga/courses/8/assignments/347/submissions?zip=1', NULL, NULL),
(219, 231, 76, 'Friday, April 21st', 25, 'https://canvas-lms.ga/courses/8/assignments/231', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:17', '2020-10-13 09:20:17', NULL, 'https://canvas-lms.ga/courses/8/assignments/231/submissions?zip=1', NULL, NULL),
(220, 286, 76, 'Monday, April 24th', 25, 'https://canvas-lms.ga/courses/8/assignments/286', 8, '<p>Today in class: you will do chapter 7 test. You need to turn in your reviews online, yes the submission boxes are now open. </p>\n<p> </p>\n<p>Bell Ringer: What is the name for Ti(NO<sub>3</sub>)<sub>4</sub>? Remember transition metals have to include something to denote their charge. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:52', NULL, 'https://canvas-lms.ga/courses/8/assignments/286/submissions?zip=1', NULL, NULL),
(221, 373, 76, 'Tuesday, April 25th', 25, 'https://canvas-lms.ga/courses/8/assignments/373', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:33', '2020-10-13 09:20:33', NULL, 'https://canvas-lms.ga/courses/8/assignments/373/submissions?zip=1', NULL, NULL),
(222, 398, 76, 'Wednesday, April 26th', 25, 'https://canvas-lms.ga/courses/8/assignments/398', 8, '<p>Today in class: we will be balancing equations!</p>\n<p>This is the absolute last day for mole projects!</p>\n<p> </p>\n<p> </p>\n<p>Bell ringer: What is a coefficient? Why when balancing equations must you change the coefficient not the subscripts on the atoms?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:36', '2020-10-13 09:20:56', NULL, 'https://canvas-lms.ga/courses/8/assignments/398/submissions?zip=1', NULL, NULL),
(223, 348, 76, 'Thursday, April 27th', 25, 'https://canvas-lms.ga/courses/8/assignments/348', 8, '<p>Today in class: Balancing reactions and chemical reactions.</p>\n<p> </p>\n<p> </p>\n<p>Bell ringer:Tell what type of reaction, then write and balance the equation for</p>\n<p>copper (II) nitrate + sodium hydroxide -----&gt;copper (II) hydroxide + sodium nitrate </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:30', NULL, 'https://canvas-lms.ga/courses/8/assignments/348/submissions?zip=1', NULL, NULL),
(224, 232, 76, 'Friday, April 28th', 25, 'https://canvas-lms.ga/courses/8/assignments/232', 8, '<p>Today in class: I have moved your lab to Monday, as per you unanimous requests. Today you will work on finishing the writing, balancing, and identifying equations from yesterday and do chapter 6 test corrections. </p>\n<p> </p>\n<p>Test corrections are worth half the credit lost.</p>\n<p> </p>\n<p>Bell Ringer: deal with it       <img src=\"https://canvas-lms.ga/courses/8/files/388/preview?verifier=47cyBOYuK49ckictLZbgAutjfXmAR4uPEhmMoQhS\" alt=\"sunglass emoji.png\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/388\" data-api-returntype=\"File\"></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:17', '2020-10-13 09:20:17', NULL, 'https://canvas-lms.ga/courses/8/assignments/232/submissions?zip=1', NULL, NULL),
(225, 314, 76, 'Quizlet', 25, 'https://canvas-lms.ga/courses/8/assignments/314', 8, '<ul>\n</ul>', NULL, '2020-10-13 09:20:26', '2020-10-13 09:20:53', NULL, 'https://canvas-lms.ga/courses/8/assignments/314/submissions?zip=1', NULL, NULL),
(226, 296, 76, 'Monday, May 1st', 25, 'https://canvas-lms.ga/courses/8/assignments/296', 8, '<p>Today in class, we will review chemical equations and reactions.</p>\n<p>Tomorrow: Chemical reactions lab! This is a test grade!!! So be sure to be here.</p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: Can you guess why we are having the lab tomorrow instead of today?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:24', '2020-10-13 09:20:24', NULL, 'https://canvas-lms.ga/courses/8/assignments/296/submissions?zip=1', NULL, NULL),
(227, 384, 76, 'Tuesday, May 2nd', 25, 'https://canvas-lms.ga/courses/8/assignments/384', 8, '<p>Today in class: LAB!!!!</p>\n<p>Your Worksheets should be completed and turned in.</p>\n<p>You need your lab sheets that I handed out. One of them is your data sheet for this lab, and the other is the instruction sheet for this lab. </p>\n<p><strong>This lab counts as your chapter 8 test grade! Don\'t goober it up!!!!</strong></p>\n<p> </p>\n<p><strong>Bell Ringer:</strong> Define the terms: Aqueous, precipitate, solution, reactant, and product. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:34', '2020-10-13 09:20:56', NULL, 'https://canvas-lms.ga/courses/8/assignments/384/submissions?zip=1', NULL, NULL),
(228, 413, 76, 'Wednesday, May 3rd', 25, 'https://canvas-lms.ga/courses/8/assignments/413', 8, '<p>Today in class: you will turn in your lab report.</p>\n<p>Then we will start chapter 9 on stoichiometry. You will need to be able to write and balance equations and to use that information as well as molecular weights to solve stoichiometry problems. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: why are the coefficients we use to balance our chemical equations called molar coefficients?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:38', '2020-10-13 09:20:57', NULL, 'https://canvas-lms.ga/courses/8/assignments/413/submissions?zip=1', NULL, NULL),
(229, 364, 76, 'Thursday, May 4th', 25, 'https://canvas-lms.ga/courses/8/assignments/364', 8, '<p>May the 4th be with you!                      <img src=\"https://canvas-lms.ga/courses/8/files/395/preview?verifier=gpJAtTO3d3ilEGKFgzXM3D3kjY1eukZEJC7Tva53\" alt=\"Deal with it Yoda.jpg\" width=\"262\" height=\"288\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/395\" data-api-returntype=\"File\"></p>\n<p> </p>\n<p>Today in Class: we will work stoichiometry problems and start on Limiting reactants.</p>\n<p>Bell Ringer: Try to explain why we need to use the mole ratios from the balanced chemical equation when doing stoichiometry problems.</p>\n<p> </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:32', '2020-10-13 09:20:32', NULL, 'https://canvas-lms.ga/courses/8/assignments/364/submissions?zip=1', NULL, NULL),
(230, 246, 76, 'Friday, May 5th', 25, 'https://canvas-lms.ga/courses/8/assignments/246', 8, '<p>Today in class: Limiting reactants and Percent composition. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: what is the significance of Cinco de Mayo?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:19', '2020-10-13 09:20:19', NULL, 'https://canvas-lms.ga/courses/8/assignments/246/submissions?zip=1', NULL, NULL),
(231, 297, 76, 'Monday, May 8th', 25, 'https://canvas-lms.ga/courses/8/assignments/297', 8, '<p>Today in class: Practice with limiting reactants and percent yield.</p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: What is a limiting reactant?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:24', '2020-10-13 09:20:52', NULL, 'https://canvas-lms.ga/courses/8/assignments/297/submissions?zip=1', NULL, NULL),
(232, 385, 76, 'Tuesday, May 9th', 25, 'https://canvas-lms.ga/courses/8/assignments/385', 8, '<p>Today in class: Stoichiometry test</p>\n<p> </p>\n<p>Then: Gas laws</p>\n<p> </p>\n<p>Bell ringer: Pick a partner for your test. Only 1 other person. </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:34', '2020-10-13 09:20:34', NULL, 'https://canvas-lms.ga/courses/8/assignments/385/submissions?zip=1', NULL, NULL),
(233, 412, 76, 'Wednesday, May 10th', 25, 'https://canvas-lms.ga/courses/8/assignments/412', 8, '<p>Today in class: Work on and turn in Gas laws, once you are done with that, you need to work on your final review worksheet I gave you yesterday. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: without it being labeled, how can you determine which gas law equation you need to use? </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:38', '2020-10-13 09:20:38', NULL, 'https://canvas-lms.ga/courses/8/assignments/412/submissions?zip=1', NULL, NULL),
