(236, 271, 76, 'Lab Safety Video I', 29, 'https://canvas-lms.ga/courses/8/assignments/271', 8, '<p>Watch the first two minutes and thirty seconds of this video.  </p>\n<p><video preload=\"none\" class=\"instructure_inline_media_comment\" data-media_comment_id=\"0_hm71pesg\" data-media_comment_type=\"video\" controls=\"controls\" poster=\"https://canvas-lms.ga/media_objects/0_hm71pesg/thumbnail?height=448&amp;type=3&amp;width=550\" src=\"https://canvas-lms.ga/courses/8/media_download?entryId=0_hm71pesg&amp;media_type=video&amp;redirect=1\" data-alt=\"\">this is a media comment</video></p>\n<p>In your composition notebook, make a list of all of the safety violations you see.  What safety rules would have eliminated these problems?  </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:21', '2020-10-13 09:20:22', NULL, 'https://canvas-lms.ga/courses/8/assignments/271/submissions?zip=1', NULL, NULL),
(237, 272, 76, 'Lab Safety Video II', 29, 'https://canvas-lms.ga/courses/8/assignments/272', 8, '<p>Watch the following video outlining all lab safety rules.  Also look at <a href=\"http://chem.answers.com/education/chemistry-lab-safety\">this site</a> which lists and explains some lab safety rules. <a id=\"\" href=\"http://chem.answers.com/education/chemistry-lab-safety\"><br></a></p>\n<p><a href=\"https://www.youtube.com/watch?v=1191ZkZUzH4\">Lab Safety Video</a></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:22', '2020-10-13 09:20:22', NULL, 'https://canvas-lms.ga/courses/8/assignments/272/submissions?zip=1', NULL, NULL),
