(239, 345, 76, 'Syllabus Activity', 29, 'https://canvas-lms.ga/courses/8/assignments/345', 8, '<p>After having read through the Chemistry I syllabus, answer the questions <a href=\"https://drive.google.com/a/acs-k12.org/file/d/0B-x7KXj4oNyAOFM0YTJpcFVBVUk/edit?usp=sharing\">on this sheet</a>, in complete sentences on your own paper.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:30', '2020-10-13 09:20:30', NULL, 'https://canvas-lms.ga/courses/8/assignments/345/submissions?zip=1', NULL, NULL),
(240, 275, 76, 'Liquid Candy', 29, 'https://canvas-lms.ga/courses/8/assignments/275', 8, '<p>Read the \"Liquid Candy Supplement\" and \"Executive Summary\" of <a href=\"http://www.cspinet.org/new/pdf/liquid_candy_final_w_new_supplement.pdf\"><em>Liquid Candy: How Soft Drinks are Harming Americans\' Health</em></a>.  Use the directions on the Chemistry I home page for a One Pager and complete and electronic One Pager with information from this article.  It must be submitted to me electronically (either share it with me from Google Apps, put it on a flash drive, or email it to me at rebecca.chesney@acs-k12.org.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:22', '2020-10-13 09:20:51', NULL, 'https://canvas-lms.ga/courses/8/assignments/275/submissions?zip=1', NULL, NULL),
