(250, 218, 76, 'Dark Chocolate Article', 29, 'https://canvas-lms.ga/courses/8/assignments/218', 8, '<p>A scientific study was performed recently at the University of California to determine the health benefits of eating dark chocolate.  Read the <a href=\"https://docs.google.com/a/acs-k12.org/document/d/1oCSt3eFU7wf97y8GBjd_WV4hInfLsR9wR1qbvyyvkJo/edit?usp=sharing\">article</a> describing the results of the study.  Answer the questions that follow in complete sentences in your composition book.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:15', '2020-10-13 09:20:15', NULL, 'https://canvas-lms.ga/courses/8/assignments/218/submissions?zip=1', NULL, NULL),
