(261, 264, 76, 'How the World Wastes Food - Science in the News', 29, 'https://canvas-lms.ga/courses/8/assignments/264', 8, '<p>We will read the article <a href=\"http://www.popsci.com/article/science/how-world-wastes-food-infographic\">\"How the World Wastes Food\"</a> from Popular Science\'s September Issue.  We will then work on writing a \"good\" summary as a class.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:21', '2020-10-13 09:20:21', NULL, 'https://canvas-lms.ga/courses/8/assignments/264/submissions?zip=1', NULL, NULL),
(262, 265, 76, 'Indirect Measurement Lab Data', 29, 'https://canvas-lms.ga/courses/8/assignments/265', 8, '<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"Indirect Measurement Lab.doc\" href=\"https://canvas-lms.ga/courses/8/files/387/download?verifier=SWzmAKr5H5jF8L3onpSRUpng68RmVma90I8BmS7p&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/387\" data-api-returntype=\"File\">Indirect Measurement Lab</a></p>\n<p>Put your group\'s data on the <a href=\"https://docs.google.com/a/acs-k12.org/spreadsheets/d/1MnUP89vXs6qTpr6Dy4xWcy16UnAEXYpMFqqUHxmKUf8/edit?usp=sharing\">class data table</a>.  Once you have the data for the whole class., calculate the average for each measurement.  Use the average to calculate the % difference for each of your measurements.  Then, write a conclusion explaining what could have caused the differences.  % Difference = [(average - measured)/average] x 100</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:21', '2020-10-13 09:20:21', NULL, 'https://canvas-lms.ga/courses/8/assignments/265/submissions?zip=1', NULL, NULL),
