(266, 277, 76, 'Mass Number vs. Atomic Mass', 29, 'https://canvas-lms.ga/courses/8/assignments/277', 8, '<p>Watch the videos <a href=\"http://www.youtube.com/watch?v=m15DWkkGe_0\">\"What is the Difference Between Mass Number and Atomic Mass?\"</a> and <a href=\"http://www.youtube.com/watch?v=ULRsJYhQmlo\">\"How to Calculate Atomic Mass Practice Problems.\"</a>  After watching, complete the <a href=\"https://docs.google.com/a/acs-k12.org/document/d/1B-EAoMJCO5GP44Z-KY7Ex81iU6ST4Lu1hwftuHboQWE/edit?usp=sharing\">Atomic Mass Practice Problems</a> in your composition book.  Come to class prepared with any questions you have.  We will be doing a lab to reinforce this concept.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:22', '2020-10-13 09:20:22', NULL, 'https://canvas-lms.ga/courses/8/assignments/277/submissions?zip=1', NULL, NULL),
(267, 226, 76, 'Excited Elements Lab Questions', 29, 'https://canvas-lms.ga/courses/8/assignments/226', 8, '<p><span>Excited Elements Lab Questions</span></p>\n<p><span><span> </span></span></p>\n<ol>\n<li>\n<p><span>Compare the color of light emitted by the spectrum tube to that observed through the spectroscope.  Explain any differences.</span></p>\n</li>\n<li>\n<p><span>Compare the spectrum of the fluorescent light to those of the gases you observed.  What gases do you think are in the fluorescent light bulb and why do you think that?</span></p>\n</li>\n<li><span>Identify a use of a spectroscope in the science of astronomy.</span></li>\n</ol>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:16', '2020-10-13 09:20:16', NULL, 'https://canvas-lms.ga/courses/8/assignments/226/submissions?zip=1', NULL, NULL),
