(271, 310, 76, 'Paint Chip Activity', 29, 'https://canvas-lms.ga/courses/8/assignments/310', 8, '<p><strong>Paint Chip Activity</strong></p>\n<p> </p>\n<p>1.      Remove the color chips from the bag and place them on a flat surface, color side up.</p>\n<p>2.      Identify a property that you can use to divide the chips into groups.  </p>\n<p>3.      Identify a second property that you can use to order the chips from top to bottom within a group.</p>\n<p>4.      Use the properties you chose to arrange the chips into a table with rows and columns.</p>\n<p>5.      Your teacher deliberately left out a chip from each bag.  Decide where to leave a gap in your table for the missing chip.</p>\n<p> </p>\n<p><strong>Questions:  Talk about these questions with your partner.  Write the answers in your composition book.</strong></p>\n<p> </p>\n<p>1.      What property did you use to divide the color chips into groups?</p>\n<p>2.      What property did your use to arrange the chips within a group from top to bottom?</p>\n<p>3.      What pattern repeats across each row of your table?</p>\n<p>4.      Based on its location on your table, describe the missing chip.</p>\n<p>5.      Compare the process you used to construct your table to the process Mendeleev used to make his table.  Describe similarities and differences.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:26', '2020-10-13 09:20:26', NULL, 'https://canvas-lms.ga/courses/8/assignments/310/submissions?zip=1', NULL, NULL),
