(288, 283, 76, 'Molecular Model Lab Questions', 29, 'https://canvas-lms.ga/courses/8/assignments/283', 8, '<p>1.  What do the letters VSEPR represent?</p>\n<p>2.  Why is the water molecule bent instead of linear?</p>\n<p>3.  How many unshared pairs of electrons are found in the fluorine molecule?</p>\n<p>4.  How many electrons are shared between the two oxygen atoms inthe oxygen molecule?</p>\n<p>5.  What shape are all binary (2 atoms) molecules?</p>\n<p>6. What does each single connector joining the atoms in your models represent?</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:23', '2020-10-13 09:20:23', NULL, 'https://canvas-lms.ga/courses/8/assignments/283/submissions?zip=1', NULL, NULL),
