(322, 273, 76, 'Lesson for October 16 and 17', 30, 'https://canvas-lms.ga/courses/8/assignments/273', 8, '<p>1.  Read p. 166 from your Chemistry Textbook. (<a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"Chemistry p. 166.pdf\" href=\"https://canvas-lms.ga/courses/8/files/373/download?verifier=6grJIoj4r18CLy3mvszHjmbKwUZ1LvKJ89zuGDsr&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/373\" data-api-returntype=\"File\">Chemistry p. 166.pdf</a>)  Complete a 3-2-1 in your composition book.  (3 Important Facts, 2 Interesting Things, 1 Question)  Use the 3-2-1 to write a summary of the page.  Why did I want you to read this?</p>\n<p>2.  Read Section 6-1 (p. 161-163), section 6-3 (p. 176-180).  Create a power point presentation (or Google Presentation or Prezi) about the information in those sections.  You must include information from at least one sited internet source for each section.  The information can be textual content or a video.  Submit the presentation to me.  Complete the Predicting Bond Types and Ionic Bonding WS that are also in Canvas in your composition book.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:22', '2020-10-13 09:20:22', NULL, 'https://canvas-lms.ga/courses/8/assignments/273/submissions?zip=1', NULL, NULL),
