(329, 228, 76, 'Flame Test Lab', 31, 'https://canvas-lms.ga/courses/8/assignments/228', 8, '<p>You will be able to complete the Flame Test Lab by watching a video of <a class=\"\" href=\"http://www.youtube.com/watch?v=1EXr_L7Ojqg\">Flame Tests</a>.  Watch the video and then complete the lab by doing the questions and writing a conclusion.  The only part you cannot complete is identifying the unknowns.</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:16', '2020-10-13 09:20:17', NULL, 'https://canvas-lms.ga/courses/8/assignments/228/submissions?zip=1', NULL, NULL),
(330, 227, 76, 'Extra Credit', 32, 'https://canvas-lms.ga/courses/8/assignments/227', 8, '<p>If you would like 10 bonus point on your next test and a free 100 activity grade, I would like you to email your state legislators and tell them how valuable Alabama Science in Motion is to you and our school. These are where we get all of the labs and many of our resources. So, if you would like to do more labs, please urge your legislators to keep funding Alabama Science in Motion in the new Year. All you have to do is write emails to your legislators and cc me on the emails. </p>\n<p> </p>\n<table width=\"594\">\n<tbody>\n<tr>\n<td width=\"189\">\n<p>Michael Sentance</p>\n<p>State Supt of Education</p>\n<p>msentance@alsde.edu</p>\n<p>334-242-9704</p>\n</td>\n<td width=\"9\">\n<p> </p>\n</td>\n<td width=\"189\">\n<p> </p>\n</td>\n<td width=\"9\">\n<p> </p>\n</td>\n<td width=\"189\">\n<p> </p>\n</td>\n</tr>\n<tr>\n<td width=\"189\">\n<p>Tim Melson</p>\n<p>Senate District 1</p>\n<p>334-242-7888</p>\n<p> </p>\n</td>\n<td width=\"9\">\n<p> </p>\n</td>\n<td width=\"189\">\n<p>William Holtzclaw</p>\n<p>Senate District 2</p>\n<p>334-242-7854</p>\n<p><a href=\"mailto:bill.holtzclaw@alsenate.gov\">bill.holtzclaw@alsenate.gov</a></p>\n</td>\n<td width=\"9\">\n<p> </p>\n</td>\n<td width=\"189\">\n<p>Clay Scofield</p>\n<p>Senate District 9</p>\n<p>334-242-7876</p>\n<p><a href=\"mailto:clay.scofield@alsenate.gov\">clay.scofield@alsenate.gov</a></p>\n</td>\n</tr>\n<tr>\n<td width=\"189\">\n<p>Arthur Orr</p>\n<p>Senate District 3</p>\n<p>334-242-7891</p>\n<p> </p>\n</td>\n<td width=\"9\">\n<p> </p>\n</td>\n<td width=\"189\">\n<p>Paul Bussman</p>\n<p>Senate District 4</p>\n<p>334-242-7855</p>\n<p><a href=\"mailto:p_bussman@bellsouth.net\">p_bussman@bellsouth.net</a></p>\n</td>\n<td width=\"9\">\n<p> </p>\n</td>\n<td width=\"189\">\n<p>Larry Stutts</p>\n<p>Senate District 6</p>\n<p>334-242-7862</p>\n<p><a href=\"mailto:larry.stutts@alsenate.gov\">larry.stutts@alsenate.gov</a></p>\n</td>\n<