(331, 317, 76, 'September/ 1 / 16', 32, 'https://canvas-lms.ga/courses/8/assignments/317', 8, '<p class=\"p1\"><span class=\"s1\"><strong><i>EXCELLENT PRACTICE PROBLEMS:</i></strong></span></p>\n<p class=\"p2\"><span class=\"s1\"><strong>Use dimensional analysis in solving each of the following problems.</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"><span class=\"s1\"><strong>1.   Convert 32.5 oz to its equivalent in cg.</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"><span class=\"s1\"><strong>2.   Convert 3.55 yd to its equivalent in cm. </strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"><span class=\"s1\"><strong>3.   Convert 143.55 mL to its equivalent in pints.</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"><span class=\"s1\"><strong>4.   Convert a speed of 35.8 mi/hr to its equivalent in m/s.</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"><span class=\"s1\"><strong>5.   Convert a density of 13.6 g/mL to its equivalent in lb/ft3.</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"><span class=\"s1\"><strong>6.   A mole of hydrogen atoms contains 6.02 X 1023 atoms and occupies 22.4 L.  How many hydrogen atoms are contained in 25.00 mL of this gas?</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"> </p>\n<ul>\n</ul>', NULL, '2020-10-13 09:20:27', '2020-10-13 09:20:27', NULL, 'https://canvas-lms.ga/courses/8/assignments/317/submissions?zip=1', NULL, NULL),
