(375, 544, 76, '(6) Unit 3 Lesson 1 Questions', 54, 'https://canvas-lms.ga/courses/13/assignments/544', 13, '<p>Read the Lesson\'s Notes and look over the slide show as well. Here are the links. They should open in a new tab. </p>\n<p><a title=\"(6) Unit 1 Lesson 3 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23675784\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 3 Lesson 1 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F29515360\" target=\"_blank\">(6) Unit 3 Lesson 1 Notes</a><a title=\"(6) Unit 3 Lesson 1 Slideshow\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F29515361\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 3 Lesson 1 Slideshow\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F29515361\" target=\"_blank\">(6) Unit 3 Lesson 1 Slideshow</a></p>\n<p>When you are finished, please answer the following questions <span style=\"background-color: #ffff00;\">(click on Grey tab below to open up questions tab)</span> and type your answers in RED and submit by the due date. Make sure to submit and double check that you submitted!</p>\n<p><a title=\"(6) Unit 3 Lesson 1 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/545\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/545\" data-api-returntype=\"Assignment\">(6) Unit 3 Lesson 1 Quiz</a></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:38', '2020-10-28 14:15:38', NULL, 'https://canvas-lms.ga/courses/13/assignments/544/submissions?zip=1', NU