(390, 564, 76, '(6) Unit 4 Study Guide', 56, 'https://canvas-lms.ga/courses/13/assignments/564', 13, '<p>Answer the Study Guide- get all answers from notes, quizlets. </p>\n<p>Put study guide in your unit 4 google drive folder. </p>\n<p>Study the study guide, the notes, the quizlets, the past quizzes, and the powerpoints!</p>\n<p> </p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:41', '2020-10-28 14:15:41', NULL, 'https://canvas-lms.ga/courses/13/assignments/564/submissions?zip=1', NULL, NULL),
