(392, 563, 76, '(6) Unit 4: Research chart of your assigned Colonial Region!', 57, 'https://canvas-lms.ga/courses/13/assignments/563', 13, '<p>As a group, use notes and research online to find good examples of what you find in your notes...</p>\n<p><span style=\"font-size: 18.6667px; background-color: #ffff00;\">As a group- research all 3 regions. You will only have to make a commercial for one though. </span></p>\n<p>See Rubric below to make sure you receive all 30 points!</p>\n<p><a title=\"(6) Colonial Regions Chart\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F32002336\" target=\"_blank\">(6) Colonial Regions Chart</a></p>\n<p><span style=\"background-color: #ffff00;\">Make a copy- share with everyone in group and everyone in Chesterfield county. Save to UNIT 4 in your google drive. </span></p>\n<p> </p>\n<p><span style=\"background-color: #00ff00; font-size: 14pt;\">Here are some links </span>to get you started. You can easily find more links if you need. </p>\n<p><strong><span style=\"font-size: 14pt;\"><a href=\"https://www.landofthebrave.info/new-england-colonies.htm\">New England colonies link</a></span></strong></p>\n<p><strong><span style=\"font-size: 14pt;\"><a href=\"https://www.landofthebrave.info/middle-colonies.htm\">Middle Colonies Link</a></span></strong></p>\n<p><strong><span style=\"font-size: 14pt;\"><a href=\"https://www.landofthebrave.info/southern-colonies.htm\">Southern Colonies Link</a></span></strong></p>\n<p style=\"padding-left: 40px;\"><strong><span style=\"font-size: 14pt;\"><a href=\"https://www.landofthebrave.info/american-history-of-13-colonies.htm\">All 13 individual colonies</a></span></strong></p>\n<p style=\"padding-left: 40px;\"><strong><span style=\"font-size: 14pt;\"><a href=\"https://www.landofthebrave.info/southern-colonies.htm\"></a><a style=\"font-family: sans-serif;\" href=\"https://www.thoughtco.com/overview-of-colonial-america-1607-1754-104575\">LInk to read about the specific individual colonies.</a></span></strong></p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:41', '2020-10-28 14:15:41', NULL, 'https://canvas-lms.ga/courses/13/assignments/563/submissions?zip=1', NULL, NULL),
(393, 560, 76, '(6) Unit 4 PBL- brainstorm your commercial- ', 57, 'https://canvas-lms.ga/courses/13/assignments/560', 13, '<p><span style=\"font-size: 14pt; background-color: #ffff00;\">Make a google doc- share with everyone in group/chesterfield county- and input at least 7 pictures and music. Remember to keep all URLs as well. Upload via web- url to Canvas when finished and then start working on the script!</span></p>\n<p> </p>\n<p>Here are the requirements again! Use these to make sure you include pictures of them!</p>\n<p>Sell it!   Describe the benefits of living in your colonial region (compared to the other places in the colonies)? what\'s good about this colonial region? convince or get others to want to live there. It must contain these features:</p>\n<ul>\n<li>Resources available in your region</li>\n<li>Geography and climate of your region</li>\n<li>Specialization/economics of the region</li>\n<li>Examples of Interdependence</li>\n<li>Social and Political life of your region</li>\n</ul>\n<p>You must create a commercial using WeVideo that promotes your colonial region.  • BEST or most CONVINCING group wins.  </p>\n<p>Your commercial must include:</p>\n<ul>\n<li>Correct and factual information about your region</li>\n<li>Reasons you would not want to go to the other two regions.</li>\n<li>Pictures/images pertaining to your region</li>\n<li>sound/music</li>\n<li>a script/narrative of the attributes of your region.</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:40', '2020-10-28 14:15:41', NULL, 'https://canvas-lms.ga/courses/13/assignments/560/submissions?zip=1', NULL, NULL),
(394, 562, 76, '(6) Unit 4 PBL- Script for commercial', 57, 'https://canvas-lms.ga/courses/13/assignments/562', 13, '<p><span style=\"font-size: 18pt; background-color: #ffff00;\">Make a google doc and write the script! Share with everyone in group! Remember the requirements. See rubric to see make sure you get full points! Submit via canvas- via web url. make sure it is shared with everyone in chesterfield county. </span></p>\n<p><span style=\"font-weight: 400;\">(Problem:  Why should a colonist settle in your region?  </span></p>\n<p><span style=\"font-weight: 400;\">Sell it!   Describe the benefits of living in your colonial region (compared to the other places in the colonies)? what\'s good about this colonial region? convince or get others to want to live there. It must contain these features:</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Resources available in your region</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Geography and climate of your region</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Specialization/economics of the region</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Examples of Interdependence</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Social and Political life of your region</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\">You must create a commercial using WeVideo that promotes your colonial region.  • BEST or most CONVINCING group wins.  </span></p>\n<p><span style=\"font-weight: 400;\">Your commercial must include:</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Correct and factual information about your region</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reasons you would not want to go to the other two regions.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pictures/images pertaining to your region</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">sound/music</span></li>\n<li style=\"font-weight: 400;\">\n<span style=\"font-weight: 400;\">a script/narrative of the attributes of your region</span><span style=\"font-weight: 400;\">.)</span>\n</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:41', '2020-10-28 14:15:41', NULL, 'https://canvas-lms.ga/courses/13/assignments/562/submissions?zip=1', NULL, NULL),
(395, 561, 76, '(6) Unit 4 PBL- Final Commercial! ', 57, 'https://canvas-lms.ga/courses/13/assignments/561', 13, '<p>Submit Presentation from Wevideo!</p>\n<p>Steps:</p>\n<p>Click- \"finish.\" It is a blue button in the right hand corner. Name the video \"Your table- Colonial commercial.\"</p>\n<p>Click the little google drive button and then click \"export\"</p>\n<p>In google drive- find the video and right click- share with everyone in chesterfield county. This is the only way I will be able to see it! Also share with everyone in your group so they can put it in their Unit 4 folders!</p>\n<p><span style=\"background-color: #ffff00;\">Turn in to canvas- Submit via website URL of the SHARABLE LINK FROM GOOGLE DRIVE, NOT FROM WEVIDEO WEBSITE. </span></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:41', '2020-10-28 14:15:41', NULL, 'https://canvas-lms.ga/courses/13/assignments/561/submissions?zip=1', NULL, NULL),
(396, 618, 76, '(8) Unit 5 PBL- Task 1- Rap Battle research chart', 58, 'https://canvas-lms.ga/courses/13/assignments/618', 13, '<p style=\"text-align: center;\"><span style=\"background-color: #ffff00; font-size: 18pt;\"><span style=\"background-color: #ffff00;\"> Patriot vs Loyalist- </span>Rap Battle</span></p>\n<p>Read <span style=\"font-weight: 400;\"><a href=\"https://docs.google.com/document/d/1u4B36jY5Za81WwURHtSDGWBHs8EPVFYFuu2PwUf-s9w/edit?usp=sharing\">A House Divided</a>- to get context for the divide in the colonies over whether or not to rebel. </span></p>\n<p>You are going to write as a group- a 40 line poem (meaning- 10 lines per person at least). This is going to turn into a heated, engaging rap battle in which you can make a cohesive historical argument while getting to be sassy and argumentative. </p>\n<p style=\"padding-left: 120px;\"><a class=\" inline_disabled\" href=\"https://www.youtube.com/watch?v=2y6a406Zf0Y\">Example- Hamiton Rap Battle #2-</a></p>\n<p>Step 1: Choose either patriot or loyalist position to argue from. You will have to first do much deeper research for both sides in order to have enough to rhyme about. </p>\n<p>Step 2: You will have to include specific terms that I require of you along with many of your own researched facts to make it interesting and sassy. </p>\n<p>Step 3: We will rap battle these out together in class and we will vote as a class who wins. Every person in a group will have to rap part of their pre-written poem. </p>\n<p><a href=\"https://docs.google.com/document/d/1zXQXmjzXkyDOd61hEn13vnxPOk9kSFxHDvIHjQK0t6c/edit?usp=sharing\">Make a copy of your research chart</a> to start to prepare content for your rap battle! </p>\n<p>Once finished, one person submit via website URL. </p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:49', '2020-10-28 14:15:49', NULL, 'https://canvas-lms.ga/courses/13/assignments/618/submissions?zip=1', NULL, NULL),
(397, 574, 76, '(6) Unit 5 PBL: Task 2- Rap Battle Script', 58, 'https://canvas-lms.ga/courses/13/assignments/574', 13, '<p><a href=\"https://docs.google.com/document/d/1BI5X7aNECEfGTtnYAWiRAbFK7Pikued-fvXukVkxyG8/edit?usp=sharing\">Make a copy- start working on your Rap Battle!</a></p>\n<ol>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">All 10 terms that you chose need to be included/mentioned.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You need to include at least 4 historical insults of the other side.  </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Needs to be 40 lines. (10 lines per person)</span></li>\n</ol>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You may want to divide by category- each person will take a few of the required terms and try to rhyme in 10 lines using those words. </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Each person has to have at least 1 historical insult of their opponent. </span></li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n<p>When you are finished, you should practice rapping your parts out loud to make for a smooth, engaging delivery when we rap as a class. </p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:42', '2020-10-28 14:15:42', NULL, 'https://canvas-lms.ga/courses/13/assignments/574/submissions?zip=1', NULL, NULL),
(398, 619, 76, '(8) Unit 5 PBL: Task 3- Presentation of Rap Battle', 58, 'https://canvas-lms.ga/courses/13/assignments/619', 13, '<p>Practice as a group reading your rap battle together, in parts. Everyone needs to participate. See the rubric for speaking skills. I will be looking for confidence, smoothness, appropriate speed of speaking, and engagement. This is a group grade- so practice as a team and give each other feedback and coaching! </p>\n<p>You do not need to submit anything for this assignment. I will grade as you present and give feedback in Canvas after the end. </p>\n<p> </p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:49', '2020-10-28 14:15:49', NULL, 'https://canvas-lms.ga/courses/13/assignments/619/submissions?zip=1', NULL, NULL);
INSERT INTO `assignment` (`id`, `assignment_id`, `user_id`, `name`, `assignment_group_id`, `html_url`, `course_id`, `description`, `due_at`, `created_at`, `updated_at`, `all_dates`, `submissions_download_url`, `quiz_id`, `discussion_topic`) VALUES
(399, 575, 76, '(6) Unit 5 PBL: Task 4- Revolutionary War Timeline  (Team)', 58, 'https://canvas-lms.ga/courses/13/assignments/575', 13, '<p><span style=\"font-weight: 400; background-color: #ffff00; font-size: 18pt;\">Task 1: Make Timeline in Google Draw: _______/ 40 points</span></p>\n<p><span style=\"font-weight: 400;\">At your table, your team will now create a timeline of the American Revolutionary War using a shared google draw! Follow all of Ms. Birnbaum’s instructions and when you are finished you will produce a timeline of the American Revolutionary War which includes the list of events and people listed below. </span></p>\n<p><a href=\"https://docs.google.com/a/ccpsnet.net/presentation/d/18S0jcTslluPRi9IT5TeXpMN6-9s-6o-wKZ8znwijIIQ/edit?usp=sharing\"><span style=\"font-weight: 400;\">Use this slideshow for great information on the events. </span></a></p>\n<p><a href=\"https://docs.google.com/a/ccpsnet.net/document/d/1yWEdqIIA8maN7yW1VpBaeLOk-HdlZtn_Pwo32M-ucHw/edit?usp=sharing\"><span style=\"font-weight: 400;\">Use this for more information and video on key events.</span></a></p>\n<p><span style=\"font-weight: 400;\">Links to Resources</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><a href=\"http://ic.galegroup.com/ic/suic/VideosDetailsPage/VideosDetailsWindow?total=3&amp;query=OQE+stamp+act&amp;prodId=SUIC&amp;windowstate=normal&amp;contentModules=&amp;mode=view&amp;displayGroupName=Videos&amp;limiter=&amp;currPage=1&amp;displayGroups=&amp;sortBy=relevance%2Cdescending&amp;p=SUIC&amp;action=e&amp;catId=&amp;view=docDisplay&amp;documentId=GALE%7CA338833747&amp;source=Bookmark&amp;u=ccpshigh&amp;jsid=009383a034bfdea9eb23a2b34a56a09d\"><strong>USI.6a-Stamp Act</strong></a></li>\n</ul>\n<ul>\n<li style=\"font-weight: 400;\"><a href=\"https://docs.google.com/a/ccpsnet.net/document/d/1mH57H2CFLd2rt9W-KxaSzTRTApWYjWJPzB2unK3vvAQ/edit?usp=sharing\"><strong>USI.6cd-Key Individuals of the American Revolution with Hyperlinks</strong></a></li>\n</ul>\n<ul>\n<li style=\"font-weight: 400;\"><a href=\"https://docs.google.com/a/ccpsnet.net/document/d/13lmCqOj9sTg4-rb-nZGfKkn-PbNNZ3N7KRUzKWWVN8E/edit?usp=sharing\"><strong>USI.6cd-Key Events of the American Revolution</strong></a></li>\n</ul>\n<p><span style=\"font-weight: 400;\">The events, dates, people and documents you should put on your timeline are all listed below.  You will need to use the resources provided to research the information that will go on the timeline. <span style=\"background-color: #ffff00;\"> Pay attention to the requirements listed and make sure your timeline meets the minimum requirements. You may exceed the minimum.  </span></span></p>\n<p> </p>\n<p><span style=\"font-weight: 400; color: #ff0000;\">Timeline Requirements:</span></p>\n<ol>\n<li style=\"font-weight: 400;\"><span style=\"color: #ff0000;\"><span style=\"font-weight: 400;\">Must include each of the events listed below. </span><span style=\"font-weight: 400;\">Total of 10</span><span style=\"font-weight: 400;\">.</span></span></li>\n<li style=\"font-weight: 400;\"><span style=\"color: #ff0000;\"><span style=\"font-weight: 400;\">Each event must have a </span><span style=\"font-weight: 400;\">description- at least 2 sentences. </span></span></li>\n<li style=\"font-weight: 400;\"><span style=\"color: #ff0000;\"><span style=\"font-weight: 400;\">Each event must be </span><span style=\"font-weight: 400;\">properly dated</span><span style=\"font-weight: 400;\">.</span></span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400; color: #ff0000;\">Each event must include one type of media. ie image, graphic, drawing etc...</span></li>\n<li style=\"font-weight: 400;\"><span style=\"color: #ff0000;\"><span style=\"font-weight: 400;\">Each media must have a caption- </span><span style=\"font-weight: 400;\">Why was this event historically significant? Important? (2-4 sentences).  </span></span></li>\n</ol>\n<p><span style=\"font-weight: 400; background-color: #ffff00;\">Important Events of the American Revolutionary War- check off!</span></p>\n<ol>\n<li><span style=\"font-weight: 400;\">Boston Massacre</span></li>\n<li><span style=\"font-weight: 400;\">Boston Tea Party</span></li>\n<li><span style=\"font-weight: 400;\">First Continental Congress</span></li>\n<li><span style=\"font-weight: 400;\">Battle of Lexington and Concord</span></li>\n<li><span style=\"font-weight: 400;\">Ride of Paul Revere</span></li>\n<li><span style=\"font-weight: 400;\">Second Continental Congress</span></li>\n<li><span style=\"font-weight: 400;\">Declaration of Independence</span></li>\n<li><span style=\"font-weight: 400;\">Battle of Saratoga</span></li>\n<li><span style=\"font-weight: 400;\">Surrender at Yorktown</span></li>\n<li><span style=\"font-weight: 400;\">Treaty of Paris</span></li>\n</ol>\n<p><span style=\"font-weight: 400; background-color: #ffff00;\">Key Individuals during the American Revolutionary War</span></p>\n<p><span style=\"color: #ff0000;\"><span style=\"font-weight: 400;\">5. Your timeline must include the image of each of the key individuals listed below.</span><span style=\"font-weight: 400;\"> Total of 9. </span><span style=\"font-weight: 400;\"> They should be placed logically within the timeline.  </span></span></p>\n<p><span style=\"color: #ff0000;\"><span style=\"font-weight: 400;\">6. </span></span><span style=\"color: #ff0000;\"><span style=\"font-weight: 400;\">Each image of the key individuals must include a description and caption. </span><span style=\"font-weight: 400;\"> Be sure to relate the caption/description to the American Revolutionary War.  </span></span></p>\n<ol>\n<li><span style=\"font-weight: 400;\">Paul Revere</span></li>\n<li><span style=\"font-weight: 400;\">Phillis Wheatley</span></li>\n<li><span style=\"font-weight: 400;\">George Washington</span></li>\n<li><span style=\"font-weight: 400;\">Thomas Jefferson</span></li>\n<li><span style=\"font-weight: 400;\">Ben Franklin</span></li>\n<li><span style=\"font-weight: 400;\">John Adams</span></li>\n<li>\n<a href=\"http://www.history.org/media/audio/Libordth_short.mp3\"><span style=\"font-weight: 400;\">Patrick Henry</span></a><span style=\"font-weight: 400;\"> - click to listen to “Give me Liberty or Give me death” excerpt from speech.  </span>\n</li>\n<li><span style=\"font-weight: 400;\">King George III</span></li>\n<li><span style=\"font-weight: 400;\">Lord Cornwallis</span></li>\n</ol>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:42', '2020-10-28 14:15:43', NULL, 'https://canvas-lms.ga/courses/13/assignments/575/submissions?zip=1', NULL, NULL),
