(433, 598, 76, '(6) Unit 7 PBL: Task 1- Do and Don\'t poster for the Oregon Trail', 63, 'https://canvas-lms.ga/courses/13/assignments/598', 13, '<p><a href=\"https://docs.google.com/document/d/1ji0SkaNo2NFKs97DWNjJkALyIvTmNJgMhpbMDaySx5E/edit?usp=sharing\">Click on this link</a> to read about the different parts of the Oregon Trail. </p>\n<p><span style=\"font-weight: 400;\">After you read it, You have successfully traveled along the Oregon Trail and have arrived in the Willamette Valley.  You will now share your insights, experience, and expertise with pioneers who have yet to make the journey.  </span><span style=\"font-weight: 400;\">You are to create a “Do’s and Don’ts “ flyer for travelers to read before they embark on their trip.  <span style=\"background-color: #ffff00;\"><strong>Create a Google Drawing- Share with everyone in chesterfield county right away. </strong></span></span></p>\n<p> </p>\n<h2><span style=\"font-weight: 400;\">Instructions:</span></h2>\n<p><span style=\"font-weight: 400;\">1) Give your flyer an appropriate title</span></p>\n<p><span style=\"font-weight: 400;\">2) A brief introduction to the reader that explains why this advice is worthwhile.  You may want to inform readers about some of your experiences on the Oregon Trail.  </span></p>\n<p><span style=\"font-weight: 400;\">3) Create a section of Do’s.  You must have a minimum of six Do’s.  Each of the 6 Do’s should be explained in three or four sentences.  An example might look like this:</span></p>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li><span style=\"font-weight: 400;\">“  Do pack lightly - this journey is a long and hard one.  you will travel nearly 2,000 miles. The Oregon trail takes you through mud, over mountains, and across rivers.  The fewer unnecessary goods you take with you , the better your trip will be. Take only that which is essential.”</span></li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n<p><span style=\"font-weight: 400;\">4) Create a section of Don’ts.  You must have a minimum of six Don’ts.  Each of the six  </span>don’ts should also be explained in three or four sentences. You may not repeat a DO in the negative. </p>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>Example: Do Pact Lightly <span style=\"font-weight: 400;\">Do Not Over pact (this would not be acceptable)</span>\n</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n<p> </p>\n<p><span style=\"font-weight: 400;\">5) Any other creative flair that students want to add to the flyer, such as graphics,</span> symbols, or illustrations.  </p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:46', '2020-10-28 14:15:46', NULL, 'https://canvas-lms.ga/courses/13/assignments/598/submissions?zip=1', NULL, NULL),
(434, 599, 76, '(6) Unit 7 PBL: Task 2- Primary Source  Chart', 63, 'https://canvas-lms.ga/courses/13/assignments/599', 13, '<p><span style=\"font-weight: 400;\">Watch <a href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/10f8139e-dcbd-4878-b2df-8f12d6c9947d\">video</a> for verbal instructions and instructions on how to rotate the primary resources. </span></p>\n<p><span style=\"font-weight: 400;\"> Click on the link to the primary source documents.  <span style=\"background-color: #ffff00;\">Click on each document and DOWNLOAD the document.</span> Once downloaded you can use the tool to flip the document so that you can read it.  Read about each pioneer group and then you are to complete the chart below.  </span></p>\n<p><a href=\"https://drive.google.com/open?id=1r6Kt624p2vh2nPP2snkDSI9a5jutv9Rq\"><span style=\"font-weight: 400;\">Primary Source Documents</span></a></p>\n<p><span style=\"font-weight: 400;\">Chart - Read each group\'s account of their lives in the west.<span style=\"background-color: #ffff00;\">  </span></span><span style=\"background-color: #ffff00;\"><a style=\"background-color: #ffff00;\" href=\"https://drive.google.com/open?id=1fPOBRoN_u0zRPvcgOQMGvWVT96e83nATXRs0wSj2Uy0\"><span style=\"font-weight: 400;\">Complete the chart.</span></a></span></p>\n<p>Submit via website URL. </p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:46', '2020-10-28 14:15:46', NULL, 'https://canvas-lms.ga/courses/13/assignments/599/submissions?zip=1', NULL, NULL),
(435, 601, 76, '(6) Unit 7 PBL: Task 4- Reformer- 1 page essay- Individual', 63, 'https://canvas-lms.ga/courses/13/assignments/601', 13, '<p><span style=\"font-weight: 400;\">You  must research one of the reformers in the slideshow -</span></p>\n<ul>\n<li><span style=\"font-weight: 400;\"> Harriet Tubman</span></li>\n<li><span style=\"font-weight: 400;\">Frederick Douglass</span></li>\n<li><span style=\"font-weight: 400;\"> William Lloyd Garrison</span></li>\n<li><span style=\"font-weight: 400;\">Isabella Sojourner Truth</span></li>\n<li><span style=\"font-weight: 400;\">Susan B. Anthony</span></li>\n<li><span style=\"font-weight: 400;\">Elizabeth Cady Stanton</span></li>\n</ul>\n<p><span style=\"background-color: #ffff00;\"><span style=\"font-weight: 400;\">Write a </span><strong>one page essay</strong></span><span style=\"font-weight: 400;\"><span style=\"background-color: #ffff00;\"> on what they did to improve life for either women or African Americans</span>. Size 12 font, at least 3 paragraphs, include citations! And put in your own words! You need a whole page! Single Spaced. </span></p>\n<p><span style=\"font-weight: 400; background-color: #ffff00;\">You may want to collect your research and your researched links in another document. </span></p>\n<p><span style=\"font-weight: 400;\"> Be sure to cite your resources. Use citation machine to do this.   Share and read each other\'s’ paper to peer edit it prior to linking it up.  </span></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:46', '2020-10-28 14:15:46', NULL, 'https://canvas-lms.ga/courses/13/assignments/601/submissions?zip=1', NULL, NULL),
(436, 600, 76, '(6) Unit 7 PBL: Task 3- Technology Paragraph- Individual. ', 63, 'https://canvas-lms.ga/courses/13/assignments/600', 13, '<p><span style=\"font-weight: 400;\"> Click on the link to the slide show.  Read about the inventions that helped bring people west.  </span></p>\n<p><span style=\"font-weight: 400;\"><a href=\"https://drive.google.com/open?id=1HShacT-j_X0j2H-rKfpenUpLf8UIDeMnjZ13Z5PG4Sw\">Slide Show </a></span></p>\n<p><span style=\"font-weight: 400;\">You must then decide which invention had the greatest impact on getting people to move west.  You must then write <span style=\"background-color: #ffff00;\">one paragraph</span> on which invention you think had the greatest impact on getting people to move west.  Write your five sentence (minimum) paragraph in the box below.  </span></p>\n<p> </p>\n<p><span style=\"font-weight: 400;\">If you leave this page without submitting because you are not finished, copy and paste your work into a google doc to save it. Otherwise it will not save. </span></p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:46', '2020-10-28 14:15:46', NULL, 'https://canvas-lms.ga/courses/13/assignments/600/submissions?zip=1', NULL, NULL),
