(447, 603, 76, '(6) Unit 8 Lesson 1 Info-graphic organizer', 64, 'https://canvas-lms.ga/courses/13/assignments/603', 13, '<p><span style=\"background-color: #ffff00;\">Every week- you will complete a lesson\'s homework/quiz and make 1-2 info-graphic organizers and link them all together!</span></p>\n<p><a href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/62c809f5-3826-49c3-b643-707444f2fc64\">Instructional video</a></p>\n<p><span style=\"text-decoration: underline;\"><span style=\"color: #0000ff;\"><a style=\"color: #0000ff;\" href=\"https://docs.google.com/document/d/1E70WQeaQAfkjisOqaF0WOknqBy6meU20eQ0riWH7Eck/edit?usp=sharing\"><span style=\"font-size: 14pt;\">Unit 8 Lessons 1-4 notes. </span></a></span></span></p>\n<ul>\n<li>\n<p>For each graphic organizer- Requirements:</p>\n<ul>\n<li>This needs to be organized, with clear titles to the pages, headings for the different topics.</li>\n<li>The pictures that you include need to have dates. At least 3 pictures. </li>\n<li>Each picture needs to have a caption- minimum of a 3 sentence description of the person/event- explaining what it was and WHY it was historically significant. </li>\n<li>\n<span style=\"background-color: #ffff00;\">Every bolded term</span> from the notes need to be included in your scrapbook in some way. Everything needs to be in your own words.</li>\n<li>You may do extra research but be sure to include links to the websites/pictures. </li>\n<li><span>You need to include a link to the next infographic on the previous one- so they all link together. For every link that is not share d with (EVERYONE IN CHESTERFIELD COUNTY) will be -3 points. </span></li>\n</ul>\n</li>\n</ul>\n<ol>\n<li><span style=\"background-color: #ffff00;\">Issues that divided the Nation(Lesson 1)- sbumit via website URL</span></li>\n</ol>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:47', '2020-10-28 14:15:47', NULL, 'https://canvas-lms.ga/courses/13/assignments/603/submissions?zip=1', NULL, NULL),
(448, 606, 76, '(6) Unit 8 Lesson 2 Info-graphic organizer', 64, 'https://canvas-lms.ga/courses/13/assignments/606', 13, '<p><span style=\"background-color: #ffff00;\">Every week- you will complete a lesson\'s homework/quiz and make 1-2 info-graphic organizers and link them all together!</span></p>\n<p><span style=\"background-color: #ffff00;\"><a class=\"external\" href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/62c809f5-3826-49c3-b643-707444f2fc64\" target=\"_blank\"><span>Instructional video</span></a></span></p>\n<p><span style=\"text-decoration: underline;\"><span style=\"color: #0000ff;\"><a style=\"color: #0000ff;\" href=\"https://docs.google.com/document/d/1E70WQeaQAfkjisOqaF0WOknqBy6meU20eQ0riWH7Eck/edit?usp=sharing\"><span style=\"font-size: 14pt;\">Unit 8 Lessons 1-4 notes. </span></a></span></span></p>\n<ul>\n<li>\n<p>For each graphic organizer- Requirements:</p>\n<ul>\n<li>This needs to be organized, with clear titles to the pages, headings for the different topics.</li>\n<li>The pictures that you include need to have dates. At least 3 pictures. </li>\n<li>Each picture needs to have a caption- minimum of a 3 sentence description of the person/event- explaining what it was and WHY it was historically significant. </li>\n<li>\n<span style=\"background-color: #ffff00;\">Every bolded term</span> from the notes need to be included in your scrapbook in some way. Everything needs to be in your own words.</li>\n<li>You may do extra research but be sure to include links to the websites/pictures. </li>\n<li><span>You need to include a link to the next infographic on the previous one- so they all link together. For every link that is not share d with (EVERYONE IN CHESTERFIELD COUNTY) will be -3 points. </span></li>\n</ul>\n</li>\n</ul>\n<p><span style=\"background-color: #ffff00;\">Graphic Organizer #2- Map of the U.S. - Divided Nation - show Union and Confederate and Border States (Lesson 2)- Submit via website URL. </span></p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:47', '2020-10-28 14:15:47', NULL, 'https://canvas-lms.ga/courses/13/assignments/606/submissions?zip=1', NULL, NULL),
(449, 609, 76, '(6) Unit 8 Lesson 3 Info-graphic organizer', 64, 'https://canvas-lms.ga/courses/13/assignments/609', 13, '<p><span style=\"background-color: #ffff00;\">Every week- you will complete a lesson\'s homework/quiz and make 1-2 info-graphic organizers and link them all together!</span></p>\n<p><span style=\"background-color: #ffff00;\"><a class=\"external\" href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/62c809f5-3826-49c3-b643-707444f2fc64\" target=\"_blank\"><span>Instructional video</span></a></span></p>\n<p><span style=\"text-decoration: underline;\"><span style=\"color: #0000ff;\"><a style=\"color: #0000ff;\" href=\"https://docs.google.com/document/d/1E70WQeaQAfkjisOqaF0WOknqBy6meU20eQ0riWH7Eck/edit?usp=sharing\"><span style=\"font-size: 14pt;\">Unit 8 Lessons 1-4 notes. </span></a></span></span></p>\n<ul>\n<li>\n<p>For each graphic organizer- Requirements:</p>\n<ul>\n<li>This needs to be organized, with clear titles to the pages, headings for the different topics.</li>\n<li>The pictures that you include need to have dates. At least 3 pictures. </li>\n<li>Each picture needs to have a caption- minimum of a 3 sentence description of the person/event- explaining what it was and WHY it was historically significant. </li>\n<li>\n<span style=\"background-color: #ffff00;\">Every bolded term</span> from the notes need to be included in your scrapbook in some way. Everything needs to be in your own words.</li>\n<li>You may do extra research but be sure to include links to the websites/pictures. </li>\n<li><span>You need to include a link to the next infographic on the previous one- so they all link together. For every link that is not share d with (EVERYONE IN CHESTERFIELD COUNTY) will be -3 points. </span></li>\n</ul>\n</li>\n</ul>\n<p>Graphic Organizer #3- <span style=\"background-color: #ffff00;\">Important people - Union and Confederate (lesson 3)- Submit via website URL</span></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:48', '2020-10-28 14:15:48', NULL, 'https://canvas-lms.ga/courses/13/assignments/609/submissions?zip=1', NULL, NULL),
(450, 612, 76, '(6) Unit 8 Lesson 4 Info-graphic organizer', 64, 'https://canvas-lms.ga/courses/13/assignments/612', 13, '<p><span style=\"background-color: #ffff00;\">Every week- you will complete a lesson\'s homework/quiz and make 1-2 info-graphic organizers and link them all together!</span></p>\n<p><span style=\"background-color: #ffff00;\"><a class=\"external\" href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/62c809f5-3826-49c3-b643-707444f2fc64\" target=\"_blank\"><span>Instructional video</span></a></span></p>\n<p><span><a class=\"external\" href=\"https://docs.google.com/document/d/1E70WQeaQAfkjisOqaF0WOknqBy6meU20eQ0riWH7Eck/edit?usp=sharing\" target=\"_blank\">Unit 8 Lessons 1-4 notes. <span class=\"screenreader-only\"> (Links to an external site.)</span></a></span></p>\n<ul>\n<li>\n<p>For each graphic organizer- Requirements:</p>\n<ul>\n<li>This needs to be organized, with clear titles to the pages, headings for the different topics.</li>\n<li>The pictures that you include need to have dates. At least 3 pictures. </li>\n<li>Each picture needs to have a caption- minimum of a 3 sentence description of the person/event- explaining what it was and WHY it was historically significant. </li>\n<li>\n<span style=\"background-color: #ffff00;\">Every bolded term</span><span> </span>from the notes need to be included in your scrapbook in some way. Everything needs to be in your own words.</li>\n<li>You may do extra research but be sure to include links to the websites/pictures. </li>\n<li><span>You need to include a link to the next infographic on the previous one- so they all link together. For every link that is not share d with (EVERYONE IN CHESTERFIELD COUNTY) will be -3 points. </span></li>\n</ul>\n</li>\n</ul>\n<ol>\n<li><span>Major Battles and Events </span></li>\n</ol>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:48', '2020-10-28 14:15:48', NULL, 'https://canvas-lms.ga/courses/13/assignments/612/submissions?zip=1', NULL, NULL),
(451, 508, 76, '(6) September Question of the Day (ODD)', 65, 'https://canvas-lms.ga/courses/13/assignments/508', 13, '<p>For your warm up-Every day answer the \"Question of the Day\" and \"What is not like the other\" for the day\'s class period. </p>\n<p>If you do not know the answer, then at least write the question/what is not like the other- into the day\'s slot and we will go over it as a class 5 minutes later. </p>\n<p>At the end of the month, you will press submit. You only have to press submit at the end of the month. </p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:34', '2020-10-28 14:15:34', NULL, 'https://canvas-lms.ga/courses/13/assignments/508/submissions?zip=1', NULL, NULL),
(452, 507, 76, '(6) September Question of the Day (Even)', 65, 'https://canvas-lms.ga/courses/13/assignments/507', 13, '<p>For your warm up-Every day answer the \"Question of the Day\" and \"What is not like the other\" for the day\'s class period. </p>\n<p>If you do not know the answer, then at least write the question/what is not like the other- into the day\'s slot and we will go over it as a class 5 minutes later. </p>\n<p>At the end of the month, you will press submit. You only have to press submit at the end of the month. </p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:34', '2020-10-28 14:15:34', NULL, 'https://canvas-lms.ga/courses/13/assignments/507/submissions?zip=1', NULL, NULL),
(453, 631, 76, 'Recorded September Question of the Day (ODD)', 65, 'https://canvas-lms.ga/courses/13/assignments/631', 13, '<p>If you are absent, watch the Question of the Day and \"What is not like the Other\" to make sure that you do not miss out on direct instruction. Make sure you reach out to your group and complete any classwork that you missed. Remember, you can do this by communicating with them on the group page.</p>\n<p><a title=\"(6) September question of the day- (ODD 20/21)\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F56384467\" target=\"_blank\">(6) September question of the day- (ODD 20/21)</a></p>\n<p> </p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:51', '2020-10-28 14:15:51', NULL, 'https://canvas-lms.ga/courses/13/assignments/631/submissions?zip=1', NULL, NULL),
(454, 634, 76, 'September Question of the Day (Even)', 66, 'https://canvas-lms.ga/courses/13/assignments/634', 13, '<p>Complete Question of the Day and \"What is not like the others\" each day you take your seat in class!</p>\n<p>It will be a classwork grade, due at the end of each month. If you are absent, ask for the question of the day from your teammates and have them catch you up. </p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:51', '2020-10-28 14:15:51', NULL, 'https://canvas-lms.ga/courses/13/assignments/634/submissions?zip=1', NULL, NULL),
(455, 628, 76, 'PRACTICE- CANVAS SCAVENGER HUNT PART 1- HW', 67, 'https://canvas-lms.ga/courses/13/assignments/628', 13, '<p>Complete the Part 1 of the Canvas Scavenger Hunt by next class.</p>\n<p>Click on the Grey Tab below! to open the assignment. When finsihed, press submit in the top right hand corner- a blue Submit Button. Make sure that it timestamps the assignment so you know that you submitted!</p>\n<ul>\n</ul>', NULL, '2020-10-28 14:15:50', '2020-10-28 14:15:50', NULL, 'https://canvas-lms.ga/courses/13/assignments/628/submissions?zip=1', NULL, NULL),
