(465, 16, 76, 'QuickQuiz 2', 9, 'https://canvas-lms.ga/courses/6/assignments/16', 6, '<p>The questions on this quiz are made to ensure that you are watching the recorded material. <br>As there are 2 lectures each week, it is set up for one question per lecture </p>', NULL, '2020-10-13 09:10:28', '2020-10-13 09:10:29', NULL, 'https://canvas-lms.ga/courses/6/quizzes/8/submissions?zip=1', NULL, NULL),
(466, 66, 76, 'Reading 3', 10, 'https://canvas-lms.ga/courses/6/assignments/66', 6, '<p><span style=\"text-decoration: underline;\">(1) ## Add information for reading assignment:</span></p>\n<p> </p>\n<p><span style=\"text-decoration: underline;\">(2) ## Add information for reading assignment:</span></p>\n<p> </p>\n<p><span style=\"text-decoration: underline; font-size: 18pt;\"><strong>Then please answer the following questions about the reading - <span style=\"color: #800000; text-decoration: underline;\" data-darkreader-inline-color=\"\"><em>please submit as a PDF</em></span>.</strong></span></p>\n<p>(1) First Reading - (5 points each)</p>\n<ol>\n<li> ##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li> </li>\n</ol>\n<p><span style=\"font-size: 12pt;\">(2) Second Reading -  (5 points each)</span></p>\n<ol>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>\n</li>\n</ol>\n<ul>\n</ul>', NULL, '2020-10-13 09:10:41', '2020-10-13 09:10:41', NULL, 'https://canvas-lms.ga/courses/6/assignments/66/submissions?zip=1', NULL, NULL),
(467, 50, 76, 'HW 3', 10, 'https://canvas-lms.ga/courses/6/assignments/50', 6, '<p>The assignment itself is worth 37 points. Questions are labeled with point values.</p>\n<p>If you have the assignment turned in on time, it will be an additional 3 points awarded for a total of 40 points. </p>\n<p> </p>\n<p>## insert HW template here</p>\n<ul>\n</ul>', NULL, '2020-10-13 09:10:39', '2020-10-13 09:10:39', NULL, 'https://canvas-lms.ga/courses/6/assignments/50/submissions?zip=1', NULL, NULL),
