(469, 78, 76, 'Respond to 2 peers WK 2 Discussion - (5 points each) ', 10, 'https://canvas-lms.ga/courses/6/assignments/78', 6, '<p><span>Respond to at least 2 peers by the end of the week, and focus on the people who don\'t have any comments on them first.  Generally/Statistically, the first few people end up with all the comments, and the bottom ones as left untouched, lets change this. =]</span></p>\n<p> </p>\n<p><span><a title=\"Discussion WK 2 - Climate Corp case study\" href=\"https://canvas-lms.ga/courses/6/discussion_topics/16\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/6/discussion_topics/16\" data-api-returntype=\"Discussion\">Discussion WK 2 - Climate Corp case study</a></span></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:10:43', '2020-10-13 09:10:43', NULL, 'https://canvas-lms.ga/courses/6/assignments/78/submissions?zip=1', NULL, NULL),
(470, 36, 76, 'Discussion WK4 - ##Discussion Topic Name', 11, 'https://canvas-lms.ga/courses/6/assignments/36', 6, '<p>Please ##  watch / read / think about / discussion topic for class</p>\n<p> </p>\n<p>## Discussion question 1 - (10 points)</p>\n<p>## Discussion question 2 - (10 points)</p>\n<p> </p>\n<p>* You may upload a video for your discussion post, or a written work, whichever you prefer. </p>', NULL, '2020-10-13 09:10:36', '2020-10-13 09:10:36', NULL, 'https://canvas-lms.ga/courses/6/assignments/36/submissions?zip=1', NULL, NULL),
