(524, 173, 76, 'Test 4 Reflections/Corrections   ', 26, 'https://canvas-lms.ga/courses/7/assignments/173', 7, '<p><span style=\"color: #000080;\"><strong>Reflections/Corrections for Exams:</strong></span></p>\n<ol>\n<li>Go to your CANVAS Math 3A course and click on \"<span style=\"color: #000080;\"><em><strong>Test Solutions</strong></em></span>\" to <em><strong>download or print the exam solutions</strong></em>.</li>\n<li>On a separate <span style=\"color: #000080;\"><strong>Word document</strong></span>, for <em><strong>each problem you got wrong or lost points on</strong></em>, answer the following questions:</li>\n<li>         <strong> a)</strong><em>  Which problem did you get wrong?</em>\n</li>\n<li>\n<em>          </em><strong> b)</strong><em> Identify your mistake and give a quick, but detailed, explanation on how you made this mistake.</em>\n</li>\n<li>\n<em>           </em><strong>c)</strong><em> What will could/would you do in the future to not make this kind of mistake?</em>\n</li>\n<li>Upload <span style=\"color: #000080;\"><em><strong>Word Document</strong></em></span> in \"<span style=\"color: #000080;\"><em><strong>Test 4 Reflections/Corrections</strong></em></span>\".</li>\n<li>\n<span style=\"color: #000080;\"><em><strong>Submit</strong></em></span> the assignment when done.</li>\n</ol>\n<p> </p>\n<p><strong>Notes:</strong></p>\n<p> <span style=\"color: #008000;\"><em>5 point problems get plus 3 added to them, 8 total points</em></span></p>\n<p><span style=\"color: #008000;\"><em>10 point problems get plus 6 added to them, 16 total points</em></span></p>\n<p><span style=\"color: #ff0000;\"><em>Problems left blank on original exam will only be eligible for half(1.5 – 3 points) of the correction points.</em></span></p>\n<p><span style=\"color: #993366;\"><em>Calculating your new percent for Test 4, the new total points will be out of 128 instead of 80.</em></span></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:19:39', '2020-10-13 09:19:47', NULL, 'https://canvas-lms.ga/courses/7/assignments/173/submissions?zip=1', NULL, NULL),
(525, 175, 76, 'Test 5 Reflections/Corrections    ', 26, 'https://canvas-lms.ga/courses/7/assignments/175', 7, '<p><span style=\"color: #000080;\"><strong>Reflections/Corrections for Exams:</strong></span></p>\n<ol>\n<li>Go to your CANVAS Math 3A course and click on \"<span style=\"color: #000080;\"><em><strong>Test Solutions</strong></em></span>\" to <em><strong>download or print the exam solutions</strong></em>.</li>\n<li>On a separate <span style=\"color: #000080;\"><strong>Word document</strong></span>, for <em><strong>each problem you got wrong or lost points on</strong></em>, answer the following questions:</li>\n<li>         <strong> a)</strong><em>  Which problem did you get wrong?</em>\n</li>\n<li>\n<em>          </em><strong> b)</strong><em> Identify your mistake and give a quick, but detailed, explanation on how you made this mistake.</em>\n</li>\n<li>\n<em>           </em><strong>c)</strong><em> What will could/would you do in the future to not make this kind of mistake?</em>\n</li>\n<li>Upload <span style=\"color: #000080;\"><em><strong>Word Document</strong></em></span> in \"<span style=\"color: #000080;\"><em><strong>Test 5 Reflections/Corrections</strong></em></span>\".</li>\n<li>\n<span style=\"color: #000080;\"><em><strong>Submit</strong></em></span> the assignment when done.</li>\n</ol>\n<p> </p>\n<p><strong>Notes:</strong></p>\n<p> <span style=\"color: #008000;\"><em>5 point problems get plus 3 added to them, 8 total points</em></span></p>\n<p><span style=\"color: #008000;\"><em>10 point problems get plus 6 added to them, 16 total points</em></span></p>\n<p><span style=\"color: #ff0000;\"><em>Problems left blank on original exam will only be eligible for half(1.5 – 3 points) of the correction points.</em></span></p>\n<p><span style=\"color: #993366;\"><em>Calculating your new percent for Test 5, the new total points will be out of 128 instead of 80.</em></span></p>\n<ul>\n</ul>', NULL, '2020-10-13 09:19:39', '2020-10-13 09:19:48', NULL, 'https://