(616, 425, 76, 'Week 11 LL: Trigonometric Identities', 34, 'https://canvas-lms.ga/courses/9/assignments/425', 9, '<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, explain the different tricks and methods for simplifying trig expressions and proving trig identies. You should include trig identies, \\\"things to look for\\\" and an example for each.\"}\' data-sheets-userformat=\'{\"2\":769,\"3\":{\"1\":0},\"11\":4,\"12\":0}\'>In your Learning Log, explain the different tricks and methods for simplifying trig expressions and proving trig identities. You should include trig identities, \"things to look for\" and an example for each.</span></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:07', '2020-10-13 09:25:07', NULL, 'https://canvas-lms.ga/courses/9/assignments/425/submissions?zip=1', NULL, NULL),
(617, 428, 76, 'Week 12 LL: Matrix Operations and Properties', 34, 'https://canvas-lms.ga/courses/9/assignments/428', 9, '<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, write directions and clear examples for how to multiply a matrix by a scalar, how to add two matrices, and how to multiply two matrices. Illustrate the properties of matrices with examples, as well. Title this entry “Matrix Operations and Properties” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":769,\"3\":{\"1\":0},\"11\":4,\"12\":0}\'>In your Learning Log, write directions and clear examples for how to:</span></p>\n<ul>\n<li><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, write directions and clear examples for how to multiply a matrix by a scalar, how to add two matrices, and how to multiply two matrices. Illustrate the properties of matrices with examples, as well. Title this entry “Matrix Operations and Properties” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":769,\"3\":{\"1\":0},\"11\":4,\"12\":0}\'> multiply a matrix by a scalar</span></li>\n<li><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, write directions and clear examples for how to multiply a matrix by a scalar, how to add two matrices, and how to multiply two matrices. Illustrate the properties of matrices with examples, as well. Title this entry “Matrix Operations and Properties” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":769,\"3\":{\"1\":0},\"11\":4,\"12\":0}\'>add two matrices</span></li>\n<li><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, write directions and clear examples for how to multiply a matrix by a scalar, how to add two matrices, and how to multiply two matrices. Illustrate the properties of matrices with examples, as well. Title this entry “Matrix Operations and Properties” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":769,\"3\":{\"1\":0},\"11\":4,\"12\":0}\'> multiply two matrices </span></li>\n</ul>\n<p><span data-sheets-value=\'{\"1\":2,\"2\":\"In your Learning Log, write directions and clear examples for how to multiply a matrix by a scalar, how to add two matrices, and how to multiply two matrices. Illustrate the properties of matrices with examples, as well. Title this entry “Matrix Operations and Properties” and include today’s date.\"}\' data-sheets-userformat=\'{\"2\":769,\"3\":{\"1\":0},\"11\":4,\"12\":0}\'>Illustrate the properties of matrices with examples, as well. </span></p>\n<p><em>Title this entry “Matrix Operations and Properties” and include today’s date.</em></p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:08', '2020-10-13 09:25:08', NULL, 'https://canvas-lms.ga/courses/9/assignments/428/submissions?zip=1', NULL, NULL),
(618, 432, 76, 'Week 13 LL: ue7 Study Guide', 34, 'https://canvas-lms.ga/courses/9/assignments/432', 9, '<p>Create a study guide with tips, instructions, diagrams, and examples in preparation for the unit 5 exam. Some of the topics you might like to include are:</p>\n<ul></ul>\n<ul>\n<li>\n<p>Graph or write equations of trigonometric functions with multiple transformations, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.1.1&amp;type=lesson#8-8\">8?8</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.1&amp;type=lesson#8-90\">8?90</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-118\">8?118</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.5&amp;type=lesson#8-155\">8?155</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-161\">CL 8?161</a>.</p>\n</li>\n<li>\n<p>Model and evaluate situations using trigonometric functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.1.2&amp;type=lesson#8-26\">8?26</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.1.2&amp;type=lesson#8-34\">8?34</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.2.2&amp;type=lesson#8-75\">8?75</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-124\">8?124</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-160\">CL 8?160</a>.</p>\n</li>\n<li>\n<p>Complete problems involving the reciprocal trigonometric functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.2.2&amp;type=lesson#8-73\">8?73</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.2&amp;type=lesson#8-102\">8?102</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.4&amp;type=lesson#8-140\">8?140</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-159\">CL 8?159</a>.</p>\n</li>\n<li>\n<p>Simplify trigonometric expressions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.2.1&amp;type=lesson#8-63\">8?63</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.1&amp;type=lesson#8-88\">8?88</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-115\">8?115</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.4&amp;type=lesson#8-139\">8?139</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-158\">CL 8?158</a>.</p>\n</li>\n<li>Verifying trigonometric identities, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.2&amp;type=lesson#8-99\">8?99</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-116\">8?116</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-123\">8?123</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.5&amp;type=lesson#8-152\">8?152</a>.</li>\n<li>Applying the angle sum and difference identities, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-114\">8?114</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-122\">8?122</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.4&amp;type=lesson#8-138\">8?138</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.5&amp;type=lesson#8-151\">8?151</a>.</li>\n</ul>\n<p>The study guide should be thorough and clear enough that a classmate could use it. Use heading and subheading as well as \"multiple representations\" to make your study guide more clear.</p>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:08', '2020-10-13 09:25:09', NULL, 'https://canvas-lms.ga/courses/9/assignments/432/submissions?zip=1', NULL, NULL),
(619, 435, 76, 'Week 1 Quiz', 34, 'https://canvas-lms.ga/courses/9/assignments/435', 9, '<p>The quiz will cover:</p>\n<ul>\n<li>\n<p>Sketch the graph of a polynomial function in factored form, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.1&amp;type=lesson#4-6\">4?6</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.1&amp;type=lesson#4-14\">4?14</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.3&amp;type=lesson#4-44\">4?44</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-75\">4?75</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-129\">CL 4?129</a>.</p>\n</li>\n<li>\n<p>Given the<span> </span><i>x</i>-intercepts (or roots) of a polynomial, write its equation, as in problems ?<a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.2&amp;type=lesson#4-27\">4?27</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-76\">4?76</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.1&amp;type=lesson#4-111\">4?111</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-130\">CL 4?130</a>.</p>\n</li>\n<li>\n<p>Determine the roots of a polynomial or solve polynomial equations, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.3&amp;type=lesson#4-42\">?4?42</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.1&amp;type=lesson#4-58\">4?58</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-83\">4?83</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.2&amp;type=lesson#4-122\">4?122</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-131\">CL 4?131</a>.</p>\n</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:09', '2020-10-13 09:25:09', NULL, 'https://canvas-lms.ga/courses/9/assignments/435/submissions?zip=1', NULL, NULL),
(620, 439, 76, 'Week 2 Quiz', 34, 'https://canvas-lms.ga/courses/9/assignments/439', 9, '<p>The week 2 quiz will cover:</p>\n<ul>\n<li>\n<p>Graph transformations of rational functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-77\">4?77</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.1&amp;type=lesson#4-110\">4?110</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.2&amp;type=lesson#4-124\">4?124</a><span> </span>(a) and (c), and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-132\">CL 4?132</a>.</p>\n</li>\n<li>\n<p>Identify horizontal, vertical, and slant asymptotes, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.1&amp;type=lesson#4-56\">4?56</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-82\">4?82</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.3&amp;type=lesson#4-100\">4?100</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-132\">CL 4?132</a>.</p>\n</li>\n<li>\n<p>State the end behavior of a polynomial or rational function, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.1&amp;type=lesson#4-6\">4?6</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.3&amp;type=lesson#4-44\">4?44</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-75\">4?75</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.1&amp;type=lesson#4-110\">4?110</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.2&amp;type=lesson#4-120\">4?120</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-135\">CL 4?135</a>.</p>\n</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:10', '2020-10-13 09:25:10', NULL, 'https://canvas-lms.ga/courses/9/assignments/439/submissions?zip=1', NULL, NULL);
INSERT INTO `assignment` (`id`, `assignment_id`, `user_id`, `name`, `assignment_group_id`, `html_url`, `course_id`, `description`, `due_at`, `created_at`, `updated_at`, `all_dates`, `submissions_download_url`, `quiz_id`, `discussion_topic`) VALUES
(621, 443, 76, 'Week 4 Quiz', 34, 'https://canvas-lms.ga/courses/9/assignments/443', 9, '<p>This week\'s quiz will focus on:</p>\n<ul>\n<li>Graph reciprocal functions and/or identify their asymptotes, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.1&amp;type=lesson#5-7\">5?7</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-68\">5?68</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-74\">5?74 (c)</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.4&amp;type=lesson#5-101\">5?101</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-135\">CL 5?135</a>.</li>\n<li>Rewrite equations of exponential functions in the form <i>y</i> =<span> </span><i>a </i>· <i>b</i><i><sup>x</sup></i>, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.2&amp;type=lesson#5-19\">5?19</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.3&amp;type=lesson#5-30\">5?30</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-72\">5?72</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-113\">5?113</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-129\">CL 5?129</a>.</li>\n<li>Understand the inverse relationship between exponents and logarithms, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.1&amp;type=lesson#5-43\">5?43</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.3&amp;type=lesson#5-87\">5?87 (a</a>),<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-132\">CL 5?132</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-134\">CL 5?134</a>.</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:11', '2020-10-13 09:25:11', NULL, 'https://canvas-lms.ga/courses/9/assignments/443/submissions?zip=1', NULL, NULL),
(622, 446, 76, 'Week 5 Quiz', 34, 'https://canvas-lms.ga/courses/9/assignments/446', 9, '<p>This week\'s quiz will focus on:</p>\n<ul>\n<li>Graph basic transformations of the family of logarithmic functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.4&amp;type=lesson#5-98\">5?98</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-116\">5?116</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-132\">CL 5?132</a>.</li>\n<li>Solve basic equations with exponents and logarithms, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.3&amp;type=lesson#5-35\">5?35</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.1&amp;type=lesson#5-44\">5?44</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.3&amp;type=lesson#5-86\">5?86</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-121\">5?121 (a)</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-131\">CL 5?131</a>.</li>\n<li>Use the definition of a logarithm to evaluate expressions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.2&amp;type=lesson#5-25\">5?25</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-64\">5?64</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-114\">5?114</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-130\">CL 5?130</a>.</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>', NULL, '2020-10-13 09:25:11', '2020-10-13 09:25:11', NULL, 'https://canvas-lms.ga/courses/9/assignments/446/submissions?zip=1', NULL, NULL),
