(658, 674, 76, '3) Send my teacher a message in Canvas', 79, 'https://canvas-lms.ga/courses/19/assignments/674', 19, '<p><span style=\"font-weight: 300; font-size: 18pt; color: #000000;\"><img src=\"https://canvas-lms.ga/courses/19/files/769/download?verifier=lW4dWIfTk4AaEf7fJElY5gNGoUzyeiP29GmqyGxx&amp;wrap=1\" alt=\"inbox\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/769\" data-api-returntype=\"File\"></span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt; color: #000000;\">From the inbox send your teacher a message about <em>what your favorite thing about school is.</em> The subject line should say “Canvas Pro”, make sure to sign your name. For your submission you need to post a screenshot of the message you sent your teacher.</span></p>\n<p> </p>\n<p><span style=\"font-weight: 300; font-size: 18pt; color: #000000;\">Not sure how to send a Canvas message? Watch the video tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt; color: #000000;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"3) Send my teacher a message in Canvas .mov\" href=\"https://canvas-lms.ga/courses/19/files/763/download?verifier=41jOy4KET3GX4sZaDoGAixgup9dt0Mr7dpHqeVNk&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/763\" data-api-returntype=\"File\">3) Send my teacher a message in Canvas .mov</a></span></p>\n<p> </p>\n<p><span style=\"font-weight: 300; font-size: 18pt; color: #000000;\"><img src=\"https://canvas-lms.ga/courses/19/files/751/download?verifier=AVjMTXqDq4se7FxPgTkyBiS8fT2oFBk6BzIY09is&amp;wrap=1\" alt=\"\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/751\" data-api-returntype=\"File\"></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:30', '2021-01-08 10:28:30', NULL, 'https://canvas-lms.ga/courses/19/assignments/674/submissions?zip=1', NULL, NULL),
(659, 672, 76, '1) Authorizing and logging into your Google account', 79, 'https://canvas-lms.ga/courses/19/assignments/672', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Sign into and activate your Google account so you can submit and access google documents in the future. Submit your school google email address below.</span></p>\n<p> </p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to authorize or log into your Google account? Watch the tutorial below.</span></p>\n<p><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"1) Authorizing and logging into your Google account .mov\" href=\"https://canvas-lms.ga/courses/19/files/767/download?verifier=nALDL8euWpSUB9E4V3yHOvy3KjjVu72BtVA1MaF8&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/767\" data-api-returntype=\"File\">1) Authorizing and logging into your Google account .mov</a></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:29', '2021-01-08 10:28:30', NULL, 'https://canvas-lms.ga/courses/19/assignments/672/submissions?zip=1', NULL, NULL),
