(661, 676, 76, '5) Access Go Math and Science Fusion Assignments', 79, 'https://canvas-lms.ga/courses/19/assignments/676', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">From the SSO main page, select Think Central for Go Math and Think Central assignments.  Find the assignment called CANVAS PRO,  open it and play the game. Submit a screenshot of the game when complete.</span></p>\n<p style=\"text-align: center;\"><img src=\"https://canvas-lms.ga/courses/19/files/750/download?verifier=e8THESxxv0o1ZzpQZg3sumKXk0t2LIHDT6PhgA9X&amp;wrap=1\" alt=\"\" width=\"276\" height=\"168\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/750\" data-api-returntype=\"File\"></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to get to access Think Central assignments for Go Math or Science Fusion assignments? Watch the tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"5) Access Go Math and Science Fusion Assignments .mov\" href=\"https://canvas-lms.ga/courses/19/files/761/download?verifier=CUXwkj6Q4c1k0DW61HBS1sz9KIfK9DdWEpaNVOde&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/761\" data-api-returntype=\"File\">5) Access Go Math and Science Fusion Assignments .mov</a></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:30', '2021-01-08 10:28:30', NULL, 'https://canvas-lms.ga/courses/19/assignments/676/submissions?zip=1', NULL, NULL),
(662, 677, 76, '6) View any announcements my teacher sent out in Canvas', 79, 'https://canvas-lms.ga/courses/19/assignments/677', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Find the announcements tab in Canvas, read your teacher’s announcement called Canvas Pro. Submit a screenshot of the announcement.</span></p>\n<p><img src=\"https://canvas-lms.ga/courses/19/files/771/download?verifier=PAqjT6UyPVQjyaNIN1eiZCQcGE0PJlJF8V9x9ois&amp;wrap=1\" alt=\"\" width=\"146\" height=\"145\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/771\" data-api-returntype=\"File\"></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to find the Announcements?  Watch the tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"6) View any announcements my teacher sent out in Canvas .mov\" href=\"https://canvas-lms.ga/courses/19/files/757/download?verifier=81BY2mnx818zMOACpMLcdzH3TMqUFClgjF8qoeS2&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/757\" data-api-returntype=\"File\">6) View any announcements my teacher sent out in Canvas .mov</a></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:30', '2021-01-08 10:28:30', NULL, 'https://canvas-lms.ga/courses/19/assignments/677/submissions?zip=1', NULL, NULL),
(663, 666, 76, '7) Taking Canvas Quizzes', 79, 'https://canvas-lms.ga/courses/19/assignments/666', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Take this quiz. In this quiz you\'ll get to learn more about your teacher and how Canvas quizzes work.  <em>It\'s okay to get some or even all of the questions wrong</em>, its just <em>for fun</em> to learn about your teacher. Review the correct answers at the end to learn more about your teacher.</span></p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://canvas-lms.ga/courses/19/files/748/download?verifier=DTyjv5IA5MT2feH0qczgvb4lktCmfT7kbVLS98uP&amp;wrap=1\" alt=\"\" width=\"164\" height=\"180\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/748\" data-api-returntype=\"File\"></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how Canvas Quizzes work or how to see your attempt history? Watch the tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"7) Taking Canvas Quizzes .mov\" href=\"https://canvas-lms.ga/courses/19/files/762/download?verifier=kAnAHqRAbQRhIz1qivxc5MdNWziyYDZsZBHHhfCS&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/762\" data-api-returntype=\"File\">7) Taking Canvas Quizzes .mov</a></span></p>', NULL, '2021-01-08 10:28:28', '2021-01-08 10:28:28', NULL, 'https://canvas-lms.ga/courses/19/quizzes/75/submissions?zip=1', NULL, NULL),
(664, 678, 76, '9) Using EdPuzzle', 79, 'https://canvas-lms.ga/courses/19/assignments/678', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Answer the questions as you go through the EdPuzzle video. Submit the EdPuzzle video when complete.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"9) Using EdPuzzle .mov\" href=\"https://canvas-lms.ga/courses/19/files/766/download?verifier=O3yZf8RCQjPzLFxGYZftd3d6IrTgfsAsXpQnc6tq&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/766\" data-api-returntype=\"File\">9) Using EdPuzzle .mov</a></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:30', '2021-01-08 10:28:30', NULL, 'https://canvas-lms.ga/courses/19/assignments/678/submissions?zip=1', NULL, NULL),
(665, 669, 76, '11) Sharing editing rights in Google Drive', 79, 'https://canvas-lms.ga/courses/19/assignments/669', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Open the assignment at the link below. Select make a copy.  When open complete the Two Truths and a Lie Activity assignment says.  Share it to your teacher’s email.  When complete click share again. Submit a screenshot of who you shared it with.</span></p>\n<p style=\"text-align: center;\"><strong><em><span style=\"font-size: 18pt;\">Two Truths and a Lie Student Edition</span></em></strong></p>\n<p style=\"text-align: center;\"><strong><em>(TEACHERS GET THIS LINK FROM THE TEACHER GUIDE)</em></strong></p>\n<p style=\"text-align: center;\"><img src=\"https://canvas-lms.ga/courses/19/files/772/download?verifier=9BjDOSoUcdyXLuuX1LGLtqKGbG05P9pWeQSbEuSZ&amp;wrap=1\" alt=\"\" width=\"469\" height=\"263\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/772\" data-api-returntype=\"File\"></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to share a Google File to your teacher\'s email? Watch the video tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"11) Sharing editing rights in Google Drive .mov\" href=\"https://canvas-lms.ga/courses/19/files/755/download?verifier=07JxXweJ1a5v5ZX8vQ8x9HgJt0l6f7zwphl3w6l9&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/755\" data-api-returntype=\"File\">11) Sharing editing rights in Google Drive .mov</a></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:29', '2021-01-08 10:28:29', NULL, 'https://canvas-lms.ga/courses/19/assignments/669/submissions?zip=1', NULL, NULL),
(666, 670, 76, '13) Replying to teacher feedback', 79, 'https://canvas-lms.ga/courses/19/assignments/670', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Find the feedback/comments your teacher left you on your assignments so far. Reply to your teacher\'s comment. Submit a screenshot of the reply.</span></p>\n<p style=\"text-align: center;\"><img src=\"https://canvas-lms.ga/courses/19/files/773/download?verifier=zujdS5b7PXN3V3LKGS6c4ljwaGN2WWljOuVe7ayG&amp;wrap=1\" alt=\"\" width=\"161\" height=\"217\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/773\" data-api-returntype=\"File\"></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to find your teacher\'s feedback? Watch the video tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"13) Replying to teacher feedback.mov\" href=\"https://canvas-lms.ga/courses/19/files/756/download?verifier=UjsCTBvErpRsI6VXYsne6mmrAIphj1OcBl59xlif&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/756\" data-api-returntype=\"File\">13) Replying to teacher feedback.mov</a></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:29', '2021-01-08 10:28:29', NULL, 'https://canvas-lms.ga/courses/19/assignments/670/submissions?zip=1', NULL, NULL),
(667, 671, 76, '14) Navigate and complete an entire module', 79, 'https://canvas-lms.ga/courses/19/assignments/671', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Make sure you have green checks next to the entire Canvas Pro module. Submit a screenshot of the module once completed. (You won\'t have a green check next to assignment #14 yet, that is okay)</span></p>\n<p> </p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to check if you\'ve completed a module? Watch the tutorial video below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_m-3ExedPCtbmW6DMeUV2k3TY9naLqmhqzK\" class=\"instructure_file_link instructure_video_link\" title=\" 14) Navigate and complete an entire module.mov\" href=\"https://canvas-lms.ga/courses/19/files/765/download?verifier=7OSPnQGaKhsENmJv0TXkXVOi0dDabaxm8hLzIu6p&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/765\" data-api-returntype=\"File\"> 14) Navigate and complete an entire module.mov</a></span></p>\n<p style=\"text-align: center;\"><span style=\"font-weight: 300; font-size: 18pt;\"><img src=\"https://canvas-lms.ga/courses/19/files/774/download?verifier=6GR6zvJI3N8QUIpjvvZocLM3GpKUjQY9bFmeolIY&amp;wrap=1\" alt=\"\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/774\" data-api-returntype=\"File\"></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:29', '2021-01-08 10:28:29', NULL, 'https://canvas-lms.ga/courses/19/assignments/671/submissions?zip=1', NULL, NULL),
(668, 673, 76, '2) Taking Screenshots', 79, 'https://canvas-lms.ga/courses/19/assignments/673', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">Practice taking a picture of what is on your computer or device\'s screen. Submit a screenshot of this assignment.</span></p>\n<div class=\"co8aDb gsrt\" aria-level=\"3\"><strong>Take<span> </span>a<span> </span>screenshot<span> </span>on your<span> </span>Mac</strong></div>\n<div class=\"RqBzHd\">\n<ol class=\"X5LH0c\">\n<li class=\"TrT0Xe\">To<span> </span><strong>take</strong><span> </span>a<span> </span><strong>screenshot</strong>, press and hold these three keys together: Shift, Command, and 3.</li>\n<li class=\"TrT0Xe\">If you see a thumbnail in the corner of your screen, click it to edit the<span> </span><strong>screenshot</strong>. Or wait for the<span> </span><strong>screenshot</strong><span> </span>to save to your desktop.</li>\n</ol>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://canvas-lms.ga/courses/19/files/760/download?verifier=tlivMoczXeqTgzhlmX8ovbKozcwejWkAt2sT7B8d\" alt=\"Mac screenshot.jpeg\" width=\"262\" height=\"196\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/760\" data-api-returntype=\"File\"></p>\n</div>\n<p> </p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to screenshot something? Watch the tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"2) Taking Screenshots.mov\" href=\"https://canvas-lms.ga/courses/19/files/752/download?verifier=4rCa4QsTzyCPtYaDGxxZNrxXt3nO582qSOS67J13&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/752\" data-api-returntype=\"File\">2) Taking Screenshots.mov</a></span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:30', '2021-01-08 10:28:30', NULL, 'https://canvas-lms.ga/courses/19/assignments/673/submissions?zip=1', NULL, NULL),
(669, 679, 76, 'Canvas Pro Scavenger Hunt Welcome', 79, 'https://canvas-lms.ga/courses/19/assignments/679', 19, '<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://canvas-lms.ga/courses/19/files/747/download?verifier=rPEBtUl4zLSBxbJgcQOwgAk8IOt6gyh7dZmwkfpX&amp;wrap=1\" alt=\"Welcome\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/747\" data-api-returntype=\"File\"></p>\n<p style=\"text-align: center;\"><video preload=\"none\" class=\"instructure_inline_media_comment\" data-media_comment_id=\"m-5RjQb5qRL46vKQVGZtiC6DrVr5keMgr3\" data-media_comment_type=\"video\" controls=\"controls\" poster=\"https://canvas-lms.ga/media_objects/m-5RjQb5qRL46vKQVGZtiC6DrVr5keMgr3/thumbnail?height=448&amp;type=3&amp;width=550\" src=\"https://canvas-lms.ga/courses/19/media_download?entryId=m-5RjQb5qRL46vKQVGZtiC6DrVr5keMgr3&amp;media_type=video&amp;redirect=1\" data-alt=\"\"></video></p>\n<p style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://canvas-lms.ga/courses/19/files/759/download?verifier=6MyaUzLIAas9kXQljtdLd24Q20pAP80lDL5yrj9u\" alt=\"Screen Shot 2020-07-03 at 3.54.45 PM.png\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/759\" data-api-returntype=\"File\"></p>\n<p style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://canvas-lms.ga/courses/19/files/764/download?verifier=tjLoDUoY7d6pZrl1QuwQnxAjTHtWn1tBfvqj0nFN\" alt=\"Screen Shot 2020-07-03 at 3.54.59 PM.png\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/764\" data-api-returntype=\"File\"></p>\n<p style=\"text-align: center;\"> </p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:30', '2021-01-08 10:28:31', NULL, 'https://canvas-lms.ga/courses/19/assignments/679/submissions?zip=1', NULL, NULL),
(670, 668, 76, '10) Using NearPod', 79, 'https://canvas-lms.ga/courses/19/assignments/668', 19, '<p> </p>\n<p><a href=\"https://share.nearpod.com/vsph/2Em7wnTPLu\"><span style=\"font-size: 18pt;\">Use this link to complete the NearPod activity <strong><em>Ice Breaker: Would You Rather?</em></strong></span></a></p>\n<p><span style=\"font-size: 18pt;\">Your student code is: ATIRD</span></p>\n<p><span style=\"font-size: 18pt;\">Make sure you include your first and last name for credit.</span></p>\n<p> </p>\n<p> </p>\n<p><span style=\"font-size: 18pt;\">Not sure how NearPod works? Watch the tutorial below.</span></p>\n<p><span style=\"font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"10) Using NearPod.mov\" href=\"https://canvas-lms.ga/courses/19/files/758/download?verifier=D7xUzoFRsEqhBJp8FTy3NpoafW0CEnPVRFEiPvBk&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/758\" data-api-returntype=\"File\">10) Using NearPod.mov</a></span></p>\n<p title=\"Play media comment.\"> </p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:29', '2021-01-08 10:28:29', NULL, 'https://canvas-lms.ga/courses/19/assignments/668/submissions?zip=1', NULL, NULL),
(671, 667, 76, '8) Posting on discussion boards', 79, 'https://canvas-lms.ga/courses/19/assignments/667', 19, '<p><span style=\"font-weight: 300; font-size: 18pt;\">On the discussion board reply with a video about what you are excited to learn about this school year.</span></p>\n<p> </p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to post a video message on a discussion board? Watch the tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"8) Posting on discussion boards .mov\" href=\"https://canvas-lms.ga/courses/19/files/754/download?verifier=1Tg48FoNHjiUvnxUy48up1j6uxq3aH8JBWM14KFn&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/754\" data-api-returntype=\"File\">8) Posting on discussion boards .mov</a></span></p>', NULL, '2021-01-08 10:28:28', '2021-01-08 10:28:29', NULL, 'https://canvas-lms.ga/courses/19/assignments/667/submissions?zip=1', NULL, NULL),
(672, 680, 76, 'Congratulations! You are a Canvas Pro!', 79, 'https://canvas-lms.ga/courses/19/assignments/680', 19, '<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><img src=\"https://canvas-lms.ga/courses/19/files/768/download?verifier=tMTf7pws1VhUrHHeJ51C5uFGCJlTsYgH1i7PzvFi&amp;wrap=1\" alt=\"Congrats\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/768\" data-api-returntype=\"File\"></span></p>\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\">Congratulations you are a canvas pro! Let your teacher know you think you have finished all of the assignments for the scavenger hunt!  Remember if you forget how to do something you can always come back to this module for video reminders!</span></p>\n<ul>\n</ul>', NULL, '2021-01-08 10:28:31', '2021-01-08 10:28:31', NULL, 'https://canvas-lms.ga/courses/19/assignments/680/submissions?zip=1', NULL, NULL);
