INSERT INTO `discussion` (`id`, `discussion_id`, `title`, `message`, `html_url`, `assignment_id`, `user_id`, `user_name`, `podcast_url`, `read_state`, `course_id`) VALUES
(1, 25, 'Kilogram loosing weight discussion', '<p>Read the Kilogram losing weight article. Discuss how this affects the scientific community and the world in general. Also how this can happen.</p>\n<p>at least a 1 paragraph discussion and respond to a minimum of 2 people.</p>', 'https://canvas-lms.ga/courses/8/discussion_topics/25', NULL, 76, NULL, NULL, 'read', 8),
(2, 24, 'The Development of a New Atomic Model', '<p>Read section 4-1 (p. 91-97), your notes for section 4-1 and watch \"<a href=\"http://www.youtube.com/watch?v=EEgAWW4vuiI\">Electromagnetic Radiation (EMR) and Light as a Wave</a>,\" \"<a href=\"http://www.youtube.com/watch?v=Hufw1mbXXGE\">Light as a Particle</a>,\" \"<a href=\"http://www.youtube.com/watch?v=GhAn8xZQ-d8\">The Bohr Atom</a>,\" and \"<a href=\"http://www.youtube.com/watch?v=QI50GBUJ48s\">Emission Spectrum of Hydrogen</a>.\"  Use information learned from these sources to answer the question \"How did the study of light lead to the Bohr Model of the atom?\"  A complete answer should include the speed of light, the photoelectric effect, quantum, and emission spectrum.</p>', 'https://canvas-lms.ga/courses/8/discussion_topics/24', NULL, 76, NULL, NULL, 'unread', 8),
(3, 23, 'Accuracy and Precision', '<p>Four students each measured the mass of one sample of matter four times.  The sample has an accepted mass of 1.43 g.  The results in the table below indicate that the data collected by which student reflect the greatest accuracy and precision?  How do you know?  Be sure to explain any calculations you had to make to come to this conclusion!</p>\n<p style=\"text-align: center;\">Mass Data of Sample</p>\n<p style=\"text-align: left;\">Student                      Trial 1                Trial 2                       Trial 3                   Trial 4</p>\n<p style=\"text-align: left;\">A                                 1.43 g                1.52 g                       1.47 g                   1.42 g</p>\n<p style=\"text-align: left;\">B                                 1.43 g                1.40 g                       1.46 g                   1.44 g</p>\n<p style=\"text-align: left;\">C                                 1.54 g                1.56 g                       1.58 g                   1.50 g</p>\n<p style=\"text-align: left;\">D                                  0.86 g               1.24 g                       1.52 g                   1.42 g</p>', 'https://canvas-lms.ga/courses/8/discussion_topics/23', NULL, 76, NULL, NULL, 'unread', 8),
(4, 22, 'Mixtures vs. Pure Substances', '<p>Why can a mixture be separated?  Can you separate a pure substance?  Why or why not?</p>', 'https://canvas-lms.ga/courses/8/discussion_topics/22', NULL, 76, NULL, NULL, 'read', 8),
(5, 21, 'Lab Accidents', '<p>Find two stories of science lab accidents.  Summarize the accidents.  What could have been done to avoid the accident? Reply to at least one other post.</p>', 'https://canvas-lms.ga/courses/8/discussion_topics/21', NULL, 76, NULL, NULL, 'unread', 8),
(6, 20, 'Liquid Candy Discussion', '<p>Without looking, summarize \"Liquid Candy.\"  What two things surprised you the most?</p>', 'https://canvas-lms.ga/courses/8/discussion_topics/20', NULL, 76, NULL, NULL, 'unread', 8),
(7, 46, 'Introduce Yourself', '<p><strong>Choose 2</strong> of the questions below to respond to in a complete sentence. Once you\'ve posted your response, <strong>read those left by other students and reply to three of their posts</strong>. </p>\n<ol>\n<li>What as the last movie you watched?</li>\n<li>What is your favorite TV show?</li>\n<li>What do you usually have for breakfast?</li>\n<li>What is your favorite sandwich?</li>\n<li>How do you like to celebrate your birthday?</li>\n<li>What upcoming event are you looking forward to?</li>\n<li>What is the last book you read?</li>\n<li>What is your favorite restaurant?</li>\n<li>What is something that no one here knows about you?</li>\n<li>What\'s your idea of the perfect day?</li>\n</ol>\n<p> </p>', 'https://canvas-lms.ga/courses/11/discussion_topics/46', 497, 76, NULL, NULL, 'unread', 11),
(8, 17, 'Introductions', '<p>Please introduce yourself with a short video (about 5 minutes) that tells us about you, and why you are in this class.</p>\n<p>Topics <em><span style=\"text-decoration: underline;\">can</span></em> include things such as:</p>\n<ul>\n<li>Name?</li>\n<li>Age?</li>\n<li>Where you are from or where you are now?</li>\n<li>Siblings/Children - with fur and without =]</li>\n<li>Hobbies?</li>\n<li>Why you are interested in the DA field?</li>\n<li>What are your career goals for the future?</li>\n<li>Are you nervous about this class at all?</li>\n<li>Do you have any experience with any of the systems we will be using?</li>\n<li>Does Pavlov think about feeding his dog when he hears the bell as well? </li>\n</ul>\n<p>Have fun with it. We are here to learn and grow together in this field, and as this is an online class, we want to get as much of a feeling of comradery as we can. </p>\n<p><img src=\"https://canvas.instructure.com/users/28391643/files/111991674/preview?verifier=HPBj1FRdY4dsoRWVkYWEGVmCGXlHXvY5dFuQrTV6\" alt=\"qLSEdKU.gif\" width=\"430\" height=\"299\"></p>\n<p>*Please respond to at least 2 peers by the end of the week, and focus on the people who don\'t have any comments on them first.  Generally/Statistically, the first few people end up with all the comments, and the bottom ones as left untouched, lets change this. =]</p>', 'https://canvas-lms.ga/courses/6/discussion_topics/17', 39, 76, NULL, NULL, 'unread', 6),
(9, 16, 'Discussion WK 2 - Climate Corp case study', '<p>Please watch the following link for the discussion prompts this week:</p>\n<p><a href=\"https://wsu.hosted.panopto.com/Panopto/Pages/Viewer.aspx?id=163355a4-7d1b-4368-ab38-abc7012fc0a0\">https://wsu.hosted.panopto.com/Panopto/Pages/Viewer.aspx?id=163355a4-7d1b-4368-ab38-abc7012fc0a0</a></p>\n<p> </p>\n<p>Please explain why you feel that Climate Corp has struggled to get more people interested in their product. (10 points)</p>\n<p>Please also include a recap of the information that is in the presentation to help justify your response.  (10 points)</p>\n<p> </p>\n<p>* You may upload a video for your discussion post, or a written work, whichever you prefer. </p>', 'https://canvas-lms.ga/courses/6/discussion_topics/16', 38, 76, NULL, NULL, 'unread', 6),
(10, 15, 'Discussion WK6 - ##Discussion Topic Name', '<p>Please ##  watch / read / think about / discussion topic for class</p>\n<p> </p>\n<p>## Discussion question 1 - (10 points)</p>\n<p>## Discussion question 2 - (10 points)</p>\n<p> </p>\n<p>* You may upload a video for your discussion post, or a written work, whichever you prefer. </p>', 'https://canvas-lms.ga/courses/6/discussion_topics/15', 37, 76, NULL, NULL, 'unread', 6),
