(18, 28, 'Unit 3 Help ', '<p>This is a place for discussion and help. Some of the things you can do here:</p>\n<ul>\n<li>Ask a question about a problem you\'re struggling with.\n<ul>\n<li>\n<strong>Answer </strong>another student\'s question!</li>\n</ul>\n</li>\n<li>Share a video or other resource you found helpful.</li>\n<li>Try to avoid doing the work for someone else. We\'re looking to learn. It\'s not about getting the assignment done, it\'s about learning from the problems that we struggle through to complete the assignment.</li>\n</ul>\n<p>Suggestions:</p>\n<ul>\n<li>Be professional. That includes:\n<ul>\n<li>Using professional language.</li>\n<li>Being polite; even when you\'re being critical.</li>\n</ul>\n</li>\n<li>Use media. Especially with math, pictures and visuals are super helpful! Create your own, or share something that you found on the internet.</li>\n</ul>', 'https://canvas-lms.ga/courses/9/discussion_topics/28', NULL, 76, NULL, NULL, 'unread', 9),
(19, 27, 'Unit 2 Help', '<p>This is a place for discussion and help. Some of the things you can do here:</p>\n<ul>\n<li>Ask a question about a problem you\'re struggling with.\n<ul>\n<li>\n<strong>Answer </strong>another student\'s question!</li>\n</ul>\n</li>\n<li>Share a video or other resource you found helpful.</li>\n<li>Try to avoid doing the work for someone else. We\'re looking to learn. It\'s not about getting the assignment done, it\'s about learning from the problems that we struggle through to complete the assignment.</li>\n</ul>\n<p>Suggestions:</p>\n<ul>\n<li>Be professional. That includes:\n<ul>\n<li>Using professional language.</li>\n<li>Being polite; even when you\'re being critical.</li>\n</ul>\n</li>\n<li>Use media. Especially with math, pictures and visuals are super helpful! Create your own, or share something that you found on the internet.</li>\n</ul>', 'https://canvas-lms.ga/courses/9/discussion_topics/27', NULL, 76, NULL, NULL, 'unread', 9),
(20, 26, 'Unit 1 Help', '<p>This is a place for discussion and help. Some of the things you can do here:</p>\n<ul>\n<li>Ask a question about a problem you\'re struggling with.\n<ul>\n<li>\n<strong>Answer </strong>another student\'s question!</li>\n</ul>\n</li>\n<li>Share a video or other resource you found helpful.</li>\n<li>Try to avoid doing the work for someone else. We\'re looking to learn. It\'s not about getting the assignment done, it\'s about learning from the problems that we struggle through to complete the assignment.</li>\n</ul>\n<p>Suggestions:</p>\n<ul>\n<li>Be professional. That includes:\n<ul>\n<li>Using professional language.</li>\n<li>Being polite; even when you\'re being critical.</li>\n</ul>\n</li>\n<li>Use media. Especially with math, pictures and visuals are super helpful! Create your own, or share something that you found on the internet.</li>\n</ul>', 'https://canvas-lms.ga/courses/9/discussion_topics/26', NULL, 76, NULL, NULL, 'unread', 9),
(21, 6, 'Introduce Yourself!', '<p>Just like you would be doing in an in person setting, it\'s important to get to know your classmates.  To do this we will play the game, 3 truths and a lie.  The idea of the game is that you say 4 statements about yourself.  3 of those will be true, and 1 of those will be a lie.  Then others have to guess which is true.  You have 3 ways to do this, and I will show all 3. Here they are:</p>\n<ol start=\"1\" type=\"1\">\n<li>Make a video of yourself introducing yourself, then saying the 4 statements about yourself (preferred option). </li>\n</ol>\n<p><iframe src=\"//www.youtube.com/embed/U4Fm5PvNB6c\" width=\"877\" height=\"493\" allowfullscreen=\"allowfullscreen\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\"></iframe></p>\n<p> </p>\n<p> </p>\n<p> </p>\n<ol start=\"2\" type=\"2\">\n<li>Take a picture of yourself, and then type your name and the 4 statements about yourself below that.</li>\n</ol>\n<p><img src=\"https://canvas-lms.ga/courses/5/files/282/preview?verifier=FrtnOtJX5RSh3v79JlooW1iQ2YIR9DTL4XPNGpPc\" alt=\"Mr. Lewis\' Pictures\" width=\"400\" height=\"261\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/5/files/282\" data-api-returntype=\"File\"></p>\n<p>Here are my 4 statements:</p>\n<ol start=\"a\" type=\"a\">\n<li>I live in Shafter.</li>\n<li>I have 2 kids.</li>\n<li>I really like chocolate.</li>\n<li>I make homemade cakes. </li>\n</ol>\n<p> </p>\n<p> </p>\n<p> </p>\n<p> </p>\n<ol start=\"3\" type=\"3\">\n<li>Type out your name, and then type the 4 statements about yourself.  </li>\n</ol>\n<p>My name is Mr. Lewis and I live in Shafter, I have 3 kids, I really like chocolate, and I make homemade cakes. </p>\n<p> </p>\n<p> </p>\n<p> </p>\n<p>After doing this, please try to guess the lie for at least 3 other classmates.  Do not tell the class which one is a lie until the next day. </p>', 'https://canvas-lms.ga/courses/5/discussion_topics/6', NULL, 76, NULL, NULL, 'unread', 5),
(22, 47, 'dfdsaf', '<p>fdsafdsa</p>', 'https://canvas-lms.ga/courses/13/discussion_topics/47', NULL, 76, NULL, NULL, 'unread', 13),
(23, 50, '5.4 | How Might You Use Groups and Collaborations? ?', '<p style=\"text-align: left;\"><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/harvesting-page-header.png\" alt=\"Harvesting with Canvas\" width=\"1065\" height=\"106\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192156\" data-api-returntype=\"File\"></p>\n<h2 style=\"text-align: left;\">\n<span style=\"color: #ff0000;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" alt=\"\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\" data-decorative=\"true\">  </strong></span><strong>TRY IT!</strong>\n</h2>\n<hr>\n<p>This is a Discussion. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Discussion Icon displayed next to it:  <i class=\"icon-discussion\"></i> </p>\n<hr>\n<ol>\n<li>Reply to this prompt and answer the following:\n<ul>\n<li>Identify at least two ways that you might use Groups and/or Collaborations in Canvas to promote collaboration</li>\n<li>What tool do you see yourself using the most often? Why?</li>\n</ul>\n</li>\n<li>Because this is a Discussion, you will be able to see your fellow participants\' responses. Provide feedback to at least one other post in this Discussion thread.</li>\n</ol>', 'https://canvas-lms.ga/courses/15/discussion_topics/50', 647, 76, NULL, NULL, 'unread', 15),
(24, 49, '3.4 | Discussions: Chat About It! ?', '<h2 style=\"text-align: left;\"><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/sprouting-page-header.png\" alt=\"Sprouting with Canvas\" width=\"1065\" height=\"106\" data-api-returntype=\"File\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192158\"></h2>\n<h2 style=\"text-align: left;\">\n<span style=\"color: #ff0000;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\">  </strong></span><strong>TRY IT!</strong>\n</h2>\n<hr>\n<p>This is a Discussion. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Discussion Icon displayed next to it:  <i class=\"icon-discussion\"></i> </p>\n<hr>\n<p><span style=\"font-size: 12pt;\">Now that we\'ve learned about Discussions, let\'s practice creating a couple of discussion posts. </span></p>\n<ol>\n<li>\n<p><span style=\"font-size: 12pt;\">In your course, use the Discussions placeholder you created in <a title=\"2.11 | Try Creating Modules ?\" href=\"https://canvas-lms.ga/courses/15/assignments/650\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/assignments/650\" data-api-returntype=\"Assignment\">2.11 | Try Creating Modules ?</a>and build out a Discussion that you would assign in one of your classes. Adjust the Discussion Settings and click Save.</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Then, reply to this prompt and answer the following:</span></p>\n<ul>\n<li>\n<p><span style=\"font-size: 12pt;\">How can Discussions enhance student learning?</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">What was the Discussion topic you created in your course? How do you expect your students to respond (text, audio, video, etc.)?</span></p>\n</li>\n</ul>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Finally, because this is a Discussion, you will be able to see your fellow participants\' responses. Provide feedback to at least one other post in this Discussion thread.</span></p>\n</li>\n</ol>', 'https://canvas-lms.ga/courses/15/discussion_topics/49', 646, 76, NULL, NULL, 'unread', 15),
(25, 48, '2.9 | Home Page Submission ?', '<p><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/nurturing-page-header.png\" alt=\"\" width=\"4917\" height=\"493\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192157\" data-api-returntype=\"File\" data-decorative=\"true\"></p>\n<h2 style=\"text-align: left;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" alt=\"\" width=\"51\" height=\"50\" data-decorative=\"true\">  TRY IT!</strong></h2>\n<hr>\n<p>This is a Discussion. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Discussion Icon displayed next to it:  <i class=\"icon-discussion\"></i> </p>\n<hr>\n<p>In this Discussion, you are asked to customize your Home Page. You can design it from the ground up or you can modify an existing template. You learned how to select and build a Home Page in <a title=\"2.7 | Home Page\" href=\"https://canvas-lms.ga/courses/15/pages/2-dot-7-%7C-home-page\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/pages/2-dot-7-%257C-home-page\" data-api-returntype=\"Page\">2.7 | Home Page.</a>  You might also want to check out some Community resources around Home Pages to get ideas for building yours, such as the Education Services <a href=\"https://community.canvaslms.com/t5/Instructional-Designer/Teacher-Appreciation-2018-Home-Page-Templates/ba-p/275466\"><span style=\"font-size: 12pt;\">Teacher Appreciation 2018 | Home Page Templates.</span></a></p>\n<p>Take a few minutes and be sure to do the following:<span> </span></p>\n<ol>\n<li><span>Set your homepage either as a Pages Front Page, or Syllabus.  </span></li>\n<li>\n<span>Make sure your home page has the following content:</span>\n<ul>\n<li><span>Course Name </span></li>\n<li><span>Instructor Name</span></li>\n<li><span>Contact Information</span></li>\n<li><span>Optional: Link to course syllabus</span></li>\n</ul>\n</li>\n<li>Then, you\'ll submit evidence below of what you customized. Feel free to either submit that in the text box, or take a screenshot of your new Home Page and share it with the others in this course!</li>\n<li>Finally, because this is a Discussion, you will be able to see your fellow participants\' Home Pages. Provide feedback to at least one other post in this Discussion thread.</li>\n</ol>\n<hr>\n<p>If you need help submitting this discussion, check out the Canvas Guide <span style=\"font-size: 12pt;\"><a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-reply-to-a-discussion-as-a-student/ta-p/334\">How do I reply to a discussion as a student</a> </span>or the Canvas Guide <span style=\"font-size: 12pt;\"><a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-embed-an-image-in-a-discussion-reply-as-a-student/ta-p/313\">How do I embed an image in a discussion reply as a student</a>.</span></p>', 'https://canvas-lms.ga/courses/15/discussion_topics/48', 645, 76, NULL, NULL, 'unread', 15),
(26, 51, 'Welcome! Introduce Yourself: Share three (3) fun facts about you!', 'No message', 'https://canvas-lms.ga/courses/16/discussion_topics/51', NULL, 76, NULL, NULL, 'unread', 16),
(27, 18, 'DATA ANALYTICS GAME NIGHT', '<p><strong><img src=\"https://canvas.instructure.com/users/28391643/files/111965392/preview?verifier=Tr63i831iJsdY4SevsFWEDt2S7Eg6O3h9S1vyKmd\" alt=\"sdfffsdfffs.jpg\" width=\"701\" height=\"117\"></strong></p>\n<p><strong>On behalf of the Data Analytics Program, we introduce GAME NIGHT</strong><strong></strong></p>\n<p><strong>To attend the event- 7:00 p.m. (PT) every Tuesday</strong></p>\n<p><strong>Select the Zoom link below:</strong><strong><br><a href=\"https://urldefense.com/v3/__https:/mx.technolutions.net/ss/c/gsby7xed_Q9kJKoUKuDGdJH9mvIlMJ4Z_jUihMf3u1FpMFHnPu_Of3hWY9yxPJdL/35s/770XYmyXSlG22GGIDAqxTQ/h0/QTCiVSlUDTmC6I1DK-cryzSLK-BQSWr99DWG5MKjFg0__;!!JmPEgBY0HMszNaDT!89fkC97XJSRDc_wJC0JQEgMao3Tj3DEitBZ5aIS_F-y5UldMnzc9t9tM_m0WUoeJSGyIDYYa%24\">https://wsu.zoom.us/j/93310998872</a></strong><br>Meeting ID: 933 1099 8872 </p>\n<p> </p>\n<p>This night is dedicated to getting to know your fellow students that are also in the Data Analytics Program at WSU. We play games, we talk, we get to know each other. </p>\n<p> </p>\n<p>Prizes are even awarded for winners of the games played. Some of the recent games that have been awarded in the past include:</p>\n<ul>\n<li>30 minutes with V. Lakshmanan, Tech Lead: Big Data and Machine Learning, Google</li>\n<li>30 minutes with Michael Brundage: Data Scientist, Google</li>\n<li>30 minutes with Matt Jockers: Dean of the College of Arts and Sciences, WSU</li>\n<li>30 minutes with Sasi Pillay: Chief Information Officer, WSU</li>\n</ul>\n<p> </p>\n<p>We thought we would provide one-on-one sessions with people who are in this field and can offer some advice on careers, as it will be much more beneficial for your future in data analytics.</p>\n<p> </p>\n<p>We’d love to de-stress and talk to you and have a good time as the last few weeks (months) have been stressful for all.</p>\n<p> </p>\n<p> Hope to see you all there!</p>', 'https://canvas-lms.ga/courses/6/discussion_topics/18', NULL, 76, NULL, NULL, 'unread', 6),
(28, 19, '*QUESTIONS AND CONCERNS* Please post and respond as needed! Cheers!  ', '<hr>\n<p><img src=\"https://canvas.instructure.com/users/28391643/files/111964572/preview?verifier=qkqPsKsA5utNBl4YtQjxs8lmHvBtOV6NkG12vxwc\" alt=\"\" width=\"895\" height=\"115\" data-decorative=\"true\" data-api-endpoint=\"https://canvas.instructure.com/api/v1/users/28391643/files/111964572\" data-api-returntype=\"File\"></p>\n<hr>\n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\"><strong>This class is an <span style=\"text-decoration: underline;\">introduction </span></strong></span></p>\n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\"><strong>to the fun and exciting world of </strong></span></p>\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\"><strong>Data Analytics / Data Science</strong></span></p>\n<hr>\n<p>If there are any questions about the material, please post them here. Please label them with the week, the assignment, and the number of the problem as applicable.</p>\n<p>Such as:</p>\n<p><span style=\"color: #800000;\" data-darkreader-inline-color=\"\">HW 6 &gt; Question 4</span></p>\n<p><span>That way we can ensure that the specific concern you have is addressed as needed. </span></p>\n<p><span>If you have a general concern about specific issues, you can also post your question such as:</span></p>\n<p><span style=\"color: #800000;\" data-darkreader-inline-color=\"\">Jupyter notebook &gt; creating a histogram</span></p>\n<p><span>The goal is to help you understand the material, and not to feel overwhelmed - so any question you have, another student may also have. </span></p>\n<p> </p>\n<p>*Anyone who feels they can help answer will be encouraged to do so. Additional points (extra credit) may be awarded at the end of class for students who go above and beyond to help their classmates.</p>\n<p>We are doing our best to help emphasize a cohort mentality for the students of data analytics, and the more we communicate and get to know each other and help each other, the better we can accomplish this.</p>\n<p><span style=\"color: #000080;\" data-darkreader-inline-color=\"\">All students are also encouraged to attend *GAME NIGHT*</span></p>', 'https://canvas-lms.ga/courses/6/discussion_topics/19', NULL, 76, NULL, NULL, 'unread', 6),
(29, 52, 'Week 1.9: Meet-n-Greet', '<h2>Get to know your classmates!</h2>\n<p>Welcome students! Just like on the first day of a face-to-face class, we will take time to get to know each other.</p>\n<p>Initial post due by [<em><strong><span style=\"background-color: #ffff99;\">insert day/date</span></strong></em>] at [<strong><em><span style=\"background-color: #ffff99;\">insert time am/pm</span></em></strong>] | Replies due by [<strong><em><span style=\"background-color: #ffff99;\">insert day/date</span></em></strong>] at [<strong><em><span style=\"background-color: #ffff99;\">insert time am/pm</span></em></strong>]</p>\n<p> </p>\n<h2>Goal/Purpose</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here an explanation of the motivation(s) for the discussion and how it ties into course content and other assignments</span></em></strong>]</p>\n<p>[<em><strong><span style=\"background-color: #ffff99;\">Suggestion</span></strong></em>] This discussion is an opportunity to meet your classmates and build community. This learning community will help you stay on track and complete our course. Getting to know each other today will help you succeed tomorrow.</p>\n<p> </p>\n<h2>Posting Directions</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here and thoroughly describe all steps and tasks to be completed</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>] You will submit one (1) post to introduce yourself to the class.</p>\n<ul>\n<li>Begin by reading all the directions for this discussion.</li>\n<li>Complete one of the two options below before <span style=\"background-color: #f1c40f;\">11 pm on Tuesday</span>:</li>\n<li>Option #1: Text Intro\n<ul>\n<li>Once you are ready, click on Reply arrow below.</li>\n<li>Click into the text box.</li>\n<li>Introduce yourself to the class. [<span style=\"background-color: #f1c40f;\">There is a word counter in the bottom right of the text box to help you keep track if you would like to have a word count]</span>\n</li>\n<li>Tell us your name, something about your personality, and a hobby or favorite thing. Don\'t reveal anything too personal in your written text.</li>\n</ul>\n</li>\n</ul>\n<ul>\n<li>Option #2: Video Intro\n<ul>\n<li>Once you are ready, click on Reply arrow below these directions.</li>\n<li>Use the built-in media recorder (slightly rounded rectangle with a white play triangle), to reply to this discussion. (See below for more help on this option.)</li>\n<li>Record a 1-2 minute video, introducing yourself to the rest of the class.</li>\n<li>Tell us your name, something about your personality, and a hobby or favorite thing. Don\'t reveal anything too personal in your words or video.</li>\n<li>You will be given the option to Record using your webcam. </li>\n</ul>\n</li>\n</ul>\n<p> </p>\n<h2>Reply Posts</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here the directions for the replies to include, but not be limited to, the following:</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>] Replies are a way for you to have a conversation with your online classmates. This is the give-and-take of listening and responding like a face-to-face conversation. Remember to be polite and respectful of difference, uniqueness, and the unknown.</p>\n<p>You will replies three (3) times to have a conversation with one or more of your classmates.</p>\n<ul>\n<li>Complete all of three (3) replies following these direction before 11pm on Friday:\n<ul>\n<li>Read or view a classmates post.</li>\n<li>Once you are ready, click on the Reply arrow right beneath their post.</li>\n<li>Post either a 1-2 minutes video reply or a 100-150 word text reply.\n<ul>\n<li>Politely ask open-ended questions to get to know them better.</li>\n</ul>\n</li>\n<li>Or if someone replied to you, you can post a 1-2 minute video or 100-150 word reply to politely answer their questions.</li>\n<li>Remember: do not reveal anything too personal in your replies.</li>\n</ul>\n</li>\n</ul>\n<p> </p>\n<h2>Submission Instructions</h2>\n<p><strong><em><span style=\"background-color: #ffff99;\">[insert here a description of how they will click into the reply line to post; how to find which peer to reply to; and if they have to post before seeing their classmate\'s posts. Consider including screenshots.</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>]</p>\n<ul>\n<li>Reply to people with the fewest replies. When you collapse all the post (up arrow icon near the original Reply line), you can see everyone\'s initial posts. On the right hand side, you can see the number of unread/total posts.</li>\n<li>Video posts are not required. If you do not have a webcam or do not wish to show your face, use the text option for your posts.</li>\n<li>As you read and respond to others\' posts, keep in mind some basic rules for <a href=\"https://create.piktochart.com/embed/6004556-core-rules-of-netiquette\" target=\"_blank\">netiquette:</a>\n<ul>\n<li>Be kind and respectful to others</li>\n<li>Use full sentences</li>\n<li>Don\'t use too much jargon</li>\n<li>Treat others online as you wish to be treated</li>\n<li>Use language that supports others</li>\n</ul>\n</li>\n</ul>\n<p> </p>\n<h2>Grading &amp; Instructor Presence</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here a description of how and when the discussion board will be graded; refer students to the rubric with explanation/screenshot on how to find it; explain instructor level of participation on board (none vs some); remind students to check Grades for feedback.</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>]</p>\n<p>Your posts will be graded in 3-5 days after the Replies are due. I will use the attached rubric to grade your posts. Don\'t know how to view the rubric? Read this <a href=\"https://tuftsedtech.screenstepslive.com/s/18992/m/73355/l/899012-student-how-do-i-view-instructor-feedback-on-an-assignment\">quick Grades overview</a>. I will post an introduction of myself and reply to 30% of the class for this discussion. If you reply to me, I may reply back. Everyone will receive feedback in comments when I grade your posts.</p>\n<p> </p>\n<h2>Resources</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here a list of possible Canvas Guides, video tutorials, or walk-thrus that will help them complete this discussion; a list of additional content resources to expand on the discussion topic; and instructor availability for office hours</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>]</p>\n<p>Here is a video tutorial on how Discussions work in Canvas.</p>\n<p><iframe title=\"vimeo-player\" src=\"https://player.vimeo.com/video/75056432\" width=\"320\" height=\"180\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p><a href=\"https://vimeo.com/75056432\">Discussion Overview</a> from <a href=\"https://vimeo.com/canvaslms\">Instructure Community</a> on <a href=\"https://vimeo.com\">Vimeo</a>.</p>\n<h2>Need more help?</h2>\n<p>Here are three ways to contact me:</p>\n<ul>\n<li>Post a question to the <a title=\"Q&amp;A Discussion Forum ? \" href=\"%24CANVAS_OBJECT_REFERENCE%24/discussion_topics/g3a4802ac66470bf2c970c3f6c07af1e4\" data-api-endpoint=\"https://rccd.instructure.com/api/v1/courses/24695/discussion_topics/167485\" data-api-returntype=\"Discussion\">class Q&amp;A</a>.</li>\n<li>Add a private comment to this Discussion.</li>\n<li>Send me a private message in Canvas Inbox.</li>\n</ul>', 'https://canvas-lms.ga/courses/18/discussion_topics/52', 659, 76, NULL, NULL, 'unread', 18),
(30, 53, '8) Posting on discussion boards', '<p><span style=\"font-weight: 300; font-size: 18pt;\">On the discussion board reply with a video about what you are excited to learn about this school year.</span></p>\n<p> </p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how to post a video message on a discussion board? Watch the tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"8) Posting on discussion boards .mov\" href=\"https://canvas-lms.ga/courses/19/files/754/download?verifier=1Tg48FoNHjiUvnxUy48up1j6uxq3aH8JBWM14KFn&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/754\" data-api-returntype=\"File\">8) Posting on discussion boards .mov</a></span></p>', 'https://canvas-lms.ga/courses/19/discussion_topics/53', 667, 76, NULL, NULL, 'unread', 19);
