(65, 67, 'Syllabus & Welcome module Quiz [Sample Name, changes as needed]', '<p>Now that you\'ve read all of the essential course info included in our syllabus and Welcome module, take this quiz to demonstrate you\'re ready to get started!</p>\n<p>You may wish to open this syllabus <strong><em><span style=\"background-color: #ffff99;\">[insert link to syllabus]</span> </em></strong>in a separate tab, so you can reference it during the quiz. To open the syllabus in a separate tab or window, hold down your Control (Command for MAC users) key, click the syllabus link above, and select the option you\'d like.</p>\n<p> </p>\n<h2>Quiz Settings</h2>\n<ul>\n<li>You will have <strong><em><span style=\"background-color: #ffff99;\">[insert number or say unlimited]</span></em></strong> attempts to complete this quiz.</li>\n<li>You will have<em> <strong><span style=\"background-color: #ffff99;\">[insert time amount]</span></strong></em> long per attempt.</li>\n<li>After the attempt, you <strong><em><span style=\"background-color: #ffff99;\">may/may not</span></em></strong> see your answers and the correct answers. [<strong><em><span style=\"background-color: #ffff99;\">Rewrite to reflect the options you selected.]</span></em></strong>\n</li>\n<li><strong><em><span style=\"background-color: #ffff99;\">[insert other quiz settings you selected.]</span></em></strong></li>\n<li>This quiz will open on [<strong><em><span style=\"background-color: #ffff99;\">insert day/time].</span></em></strong>\n</li>\n<li>This quiz is due on <strong><em><span style=\"background-color: #ffff99;\">[insert day/time].</span></em></strong>\n</li>\n<li>This quiz will no longer be available after <strong><em><span style=\"background-color: #ffff99;\">[</span></em><em><span style=\"background-color: #ffff99;\"><strong><em>i</em></strong>nsert day/time].</span></em></strong>\n</li>\n</ul>\n<p><strong><em><span style=\"background-color: #ffff99;\">[NOTE: Make sure the options you select are reflected in this description.]</span></em></strong></p>\n<p> </p>', 'https://canvas-lms.ga/courses/18/quizzes/67', 'assignment', NULL, NULL, NULL, 18),
