(70, 68, 'Week 1.8: Check for Understanding: Tips for Online Learning and Netiquette', '<p>Now that you\'ve read about tips for online learning success, the syllabus, and about netiquette take this check for understanding to demonstrate you\'re ready to get started!</p>\n<p>You may wish to open this syllabus <strong><em><span style=\"background-color: #ffff99;\">[insert link to syllabus]</span> </em></strong>in a separate tab, so you can reference it during the quiz.</p>\n<p><span style=\"background-color: #f1c40f;\">Check the settings and add a due date.</span></p>\n<p> </p>', 'https://canvas-lms.ga/courses/18/quizzes/68', 'assignment', NULL, NULL, NULL, 18),
(71, 69, 'Week 2 Quiz [Sample Name, changes as needed]', '<p><span style=\"background-color: #ffff99;\"><strong><em>[Note: This is a template based on best practices for quizzes. </em></strong></span><span style=\"background-color: #ffff99;\"><strong><em>Use this template as a starting point; make changes as needed to fit your course, content, and teaching style. Best practices recommends a consistent prompt structure for all your quizzes (by type) so that students know what to expect. This consistency lessens student confusion and increases their likely participation.]</em></strong></span></p>\n<p> </p>\n<h2><strong>Goal</strong></h2>\n<p><span style=\"background-color: #ffff99;\"><strong><em>[insert here an explanation of the learning objective]</em></strong></span></p>\n<p> </p>\n<h2><strong>Purpose</strong></h2>\n<p><span style=\"background-color: #ffff99;\"><strong><em>[insert here an explanation of the motivation(s) for the assignment and how it ties into course content and other assignments]</em></strong></span><br><br></p>\n<h2><strong>Directions</strong></h2>\n<p><strong><span style=\"background-color: #ffff99;\"><em>[insert here and thoroughly describe all steps and tasks to be completed; this could include, but not be limited to, the following:]</em></span></strong></p>\n<ul>\n<li><strong><span style=\"background-color: #ffff99;\"><em>resources/content to read </em></span></strong></li>\n<li><strong><span style=\"background-color: #ffff99;\"><em>connections to previous/current/future course content and materials</em></span></strong></li>\n<li><strong><span style=\"background-color: #ffff99;\"><i>step-by-step directions</i></span></strong></li>\n<li><strong><span style=\"background-color: #ffff99;\"><i>length of time to complete</i></span></strong></li>\n</ul>\n<p> </p>\n<h2><strong>Submission Instructions</strong></h2>\n<p><span style=\"background-color: #ffff99;\"><strong><em>[insert here a description of how and what to submit. Consider including screen