(74, 75, '7) Taking Canvas Quizzes', '<p><span style=\"font-weight: 300; font-size: 18pt;\">Take this quiz. In this quiz you\'ll get to learn more about your teacher and how Canvas quizzes work.  <em>It\'s okay to get some or even all of the questions wrong</em>, its just <em>for fun</em> to learn about your teacher. Review the correct answers at the end to learn more about your teacher.</span></p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://canvas-lms.ga/courses/19/files/748/download?verifier=DTyjv5IA5MT2feH0qczgvb4lktCmfT7kbVLS98uP&amp;wrap=1\" alt=\"\" width=\"164\" height=\"180\" data-decorative=\"true\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/748\" data-api-returntype=\"File\"></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\">Not sure how Canvas Quizzes work or how to see your attempt history? Watch the tutorial below.</span></p>\n<p><span style=\"font-weight: 300; font-size: 18pt;\"><a id=\"media_comment_maybe\" class=\"instructure_file_link instructure_video_link\" title=\"7) Taking Canvas Quizzes .mov\" href=\"https://canvas-lms.ga/courses/19/files/762/download?verifier=kAnAHqRAbQRhIz1qivxc5MdNWziyYDZsZBHHhfCS&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/19/files/762\" data-api-returntype=\"File\">7) Taking Canvas Quizzes .mov</a></span></p>', 'https://canvas-lms.ga/courses/19/quizzes/75', 'assignment', NULL, NULL, NULL, 19);
